INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(13, 86, '<p><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Tempat parkir seluas 360&nbsp;</span></font><img src=\"data:image/png;base64,\" alt=\"\"><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">&nbsp;</span></font><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">dapat menampung tidak lebih dari 30&nbsp;</span></font><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">&nbsp;kendaraan. Untuk parkir sebuah sedan diperlukan rata-rata 6&nbsp;</span></font><img src=\"data:image/png;base64,\" alt=\"\"><span times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\" style=\"font-size: 16px;\">dan sebuah bus 24&nbsp;</span>&nbsp;<img src=\"data:image/png;base64,\" alt=\"\">. Jika banyaknya sedan dinyatakan dalam x dan bus dalam y, maka model matematika dari pernyataan di atas adalah…</p>', '#_#1_#_<img src=\"data:image/png;base64,\" alt=\"\">#_#2_#_<img src=\"data:image/png;base64,\" alt=\"\">#_#3_#_<img src=\"data:image/png;base64,\" alt=\"\">#_#4_#_<img src=\"data:image/png;base64,\" alt=\"\">#_#5_#_<img src=\"data:image/png;base64,\" alt=\"\">#_#6_#_#_#', '1');
