(20, 86, '<p><span style=\"font-size: 13.2346px;\">Keliling bangun di bawah ini, apabila Panjang AB = 10 cm, BC = 5 cm dan CD = 8 cm&nbsp; adalah…</span></p><p><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"font-size: 13.2346px;\"><br></span></p>', '#_#1_#_<div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">18 cm</span></font></div>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">23 cm</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">28 cm</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">30 cm</span>#_#5_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">33 cm</span>#_#6_#_#_#', '3'),
(21, 86, '<p><span style=\"font-size: 13.2346px;\">Luas bangun di bawah ini dalam&nbsp;</span><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"font-size: 13.2346px;\">, apabila Panjang AD = 7 cm. CD = 8 cm dan tinggi bangunnya 6 cm adalah…</span></p><p><img src=\"data:image/png;base64,\" alt=\"\"><span style=\"font-size: 13.2346px;\"><br></span></p>', '#_#1_#_56#_#2_#_48#_#3_#_42#_#4_#_21#_#5_#_15#_#6_#_#_#', '2'),
