(23, 86, '<div><span style=\"font-size: 13.2346px;\">Diketahui :</span></div><div><span style=\"font-size: 13.2346px;\">(1)&nbsp; 2 merupakan bilangan prima genap</span></div><div><span style=\"font-size: 13.2346px;\">(2)&nbsp; Apa kabarmu hari ini ?</span></div><div><span style=\"font-size: 13.2346px;\">(3)&nbsp; Lukisan ini Indah sekali</span></div><div><span style=\"font-size: 13.2346px;\">(4)&nbsp; 10 – 7 = 17</span></div><div><span style=\"font-size: 13.2346px;\">&nbsp;Dari kalimat – kalimat tersebut, yang merupakan pernyataan adalah…</span></div>', '#_#1_#_(1)#_#2_#_(2)#_#3_#_(1) dan (3)#_#4_#_(1) dan (4)#_#5_#_<p>(1), (3) dan (4)<br></p>#_#6_#_#_#', '4'),
(24, 86, '<div><span style=\"font-size: 13.2346px;\">Diketahui,</span></div><div><span style=\"font-size: 13.2346px;\">Premis 1 : Jika pengendara tertib lalu lintas, maka lalu lintas lancar.</span></div><div><span style=\"font-size: 13.2346px;\">Premis 2 : Jika lalu lintas lancar, maka saya tidak terlambat ujian.</span></div><div><span style=\"font-size: 13.2346px;\">Kesimpulan yang sah dari premis – premis tersebut adalah …</span></div>', '#_#1_#_Jika lalu lintas tidak lancar, maka saya terlambat ujian.#_#2_#_Jika pengendara tertib lalu lintas, maka saya tidak terlambat ujian.#_#3_#_Jika pengendara tidak tertib lalu lintas, maka saya terlambat ujian.#_#4_#_Jika lalu lintas tidak lancar, maka pengendara tidak tertib lalu lintas.#_#5_#_Pengendara tertib lalu lintas dan saya terlambat ujian.#_#6_#_#_#', '2'),
(25, 86, '<div><span style=\"font-size: 13.2346px;\">Ingkaran dari pernyataan , “ Jika Gavel siswa SMKN 1 Garut, maka Gavel cepat mendapat pekerjaan” adalah …</span></div>', '#_#1_#_Jika Gavel bukan siswa SMKN 1 Garut, maka Gavel cepat mendapat pekerjaan.#_#2_#_Jika Gavel bukan siswa SMKN 1 Garut, maka Gavel tidak cepat mendapat pekerjaan.#_#3_#_Jika Gavel siswa SMKN 1 Garut, maka Gavel tidak cepat mendapat pekerjaan.#_#4_#_Gavel bukan siswa SMKN 1 Garut dan Gavel cepat mendapat pekerjaan.#_#5_#_Gavel siswa SMKN 1 Garut dan Gavel tidak cepat mendapat pekerjaan.#_#6_#_#_#', '5'),
