(44, 87, '<div>Negara Indonesia tidak menganut terori pemisahan kekuasaan, akan tetapi menganut terori pembagian kekuasaan, pernyataan ini dibuktikan dari adanya .....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Pembagian kekuasaan Eksekitif, Legislatif, dan Yudikatif yang saling berdiri sendiri dan independen</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Pembagian kekuasaan Eksekutif, Legislatif, dam Eksaminatif yang saling berdiri sendiri dan independen</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Pembagian kekuasaan Eksekutif, Legislatif, dan Inspektif yang saling berkoordinasi dan tidak dipisahkan</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Pembagian kekuasaan Eksekutif, Legislatif, dan Yudikatif yang saling berkoordinasi dan tidak dipisahkan</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Pembagian kekuasaan Eksekutif, Eksaminatif, dan Yudikatif yang saling berkoordinasi dan tidak dipisahkan</span>#_#6_#_#_#', '4'),
(45, 87, '<div>Pancasila merupakan hasil perenungan panjang mengenai nilai-nilai kehidupan di Indonesia. Hal tersebut menjadikan Pancasila memiliki nilai-nilai yang ideal dan yang dicita-citakan. Berdasarkan hal tersebut,&nbsp; Pancasila berkedudukan sebagai&nbsp; ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">dasar negara</span>#_#2_#_<span style=\"font-size: 12.8889px;\">ideologi negara</span>#_#3_#_<span style=\"font-size: 12.8889px;\">pandangan hidup bangsa</span>#_#4_#_<span style=\"font-size: 12.8889px;\">sumber dari segala sumber hukum</span>#_#5_#_<span style=\"font-size: 12.8889px;\">kepribadian bangsa</span>#_#6_#_#_#', '3'),
(46, 87, '<div>Pada suatu diskusi, adakalanya pendapat yang kita ungkapkan bertentangan dengan hasil keputusan secara umum. namun, sebagai warga negara yang baik hendaknya kita tetap bertanggung jawab menerima dan melaksanakan hasil tersebut. Perbuatan tersebut mencerminkan adanya penerapan nilai Pancasila sila ke ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">satu</span>#_#2_#_<span style=\"font-size: 12.8889px;\">dua</span>#_#3_#_<span style=\"font-size: 12.8889px;\">tiga</span>#_#4_#_<span style=\"font-size: 12.8889px;\">empat</span>#_#5_#_<span style=\"font-size: 12.8889px;\">lima</span>#_#6_#_#_#', '4'),
(47, 87, '<div>Negara berkewajiban melindungi kebebasan beragama setiap warga negaranya. Berkaitan dengan hal tersebut, Pemerintah RI bersama DPR RI pada tahun 2005 telah meratifikasi Konvensi Internasional tentang hak-hak sipil dan politik melalui UU No.12 Tahun 2005. Pasal 18 ayat (1) UU No.12 Tahun 2005 menegaskan bahwa setiap orang berhak atas kebebasan berpikir, berkeyakinan dan beragama.&nbsp;</div><div>Berkaitan dengan hal tersebut kebebasan beragama yang ditegaskan dalam Undang-Undang tersebut apabila dikaitkan dengan ketentuan pasal 29 ayat (2) UUD NRI Tahun 1945 adalah .....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Bebas untuk mengajak orang lain beribadah sesuai dengan keyakinan agamanya</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Bebas untuk memilih agama sesuai dengan keyakinan masing-masing</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Bebas untuk memengaruhi orang lain untuk berpindah agama dan keyakinan</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Bebas untuk tidak mengikuti ajaran agama yang dianut oleh prang tua</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Bebas untuk tidak memeluk agama sebagaimana yang telah ditetapkan pemerintah</span>#_#6_#_#_#', '2'),
(48, 87, '<div>Suatu negara dapat terbentuk karena adanya beberapa unsur yang mendukungnya. Unsur yang tidak harus ada di saat negara tersebut berdiri tetapi harus dipenuhi setelah negara tersebut berdiri, misalnya pengakuan dari negara lain, adalah unsur …</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">wilayah</span>#_#2_#_<span style=\"font-size: 12.8889px;\">rakyat</span>#_#3_#_<span style=\"font-size: 12.8889px;\">deklaratif</span>#_#4_#_<p><span style=\"font-size: 12.8889px;\">de jure</span><br></p>#_#5_#_<span style=\"font-size: 12.8889px;\">de facto</span>#_#6_#_#_#', '3'),
(49, 87, '<div>Berdasarkan pasal 1 ayat (1) UUD NRI tahun 1945 disebutkan “Negara Indonesia ialah negara kesatuan yang berbentuk republik.” Bentuk Republik, pada pasal di&nbsp; atas menunjukan pada ....&nbsp;</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">bentuk&nbsp; negara</span>#_#2_#_<span style=\"font-size: 12.8889px;\">bentuk pemerintahan</span>#_#3_#_<span style=\"font-size: 12.8889px;\">sistem pemerintahan</span>#_#4_#_<span style=\"font-size: 12.8889px;\">sistem kabinet</span>#_#5_#_<div>sistem demokrasi</div>#_#6_#_#_#', '2'),
(50, 87, '<div>Cara pandang dan sikap bangsa Indonesia terhadap diri dan lingkungannya dengan mengutamakan persatuan dan kesatuan bangsa serta kesatuan wilayah dalam penyelenggaraan kehidupan bermasyarakat, berbangsa, dan bernegara, merupakan pengertian dari ....</div>', '#_#1_#_<div style=\"text-align: justify; text-indent: -24px;\">&nbsp; &nbsp; &nbsp; Wawasan Nusantara<br></div>#_#2_#_<span style=\"font-size: 12.8889px;\">Ancaman</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Integrasi Nasional</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Bela Negara</span>#_#5_#_<div>Integrasi sosial</div>#_#6_#_#_#', '1'),
(51, 87, '<div>Perhatikan pernyataan pernyataan berikut ini :</div><div>1)<span style=\"white-space:pre\">	</span>menumbuh kembangkan kesadaran serta semangat kebangsaan Indonesia&nbsp;</div><div>2)<span style=\"white-space:pre\">	</span>menanamkan dan memupuk rasa cinta negara lain sehingga muncul ketidakrelaan berkorban untuk membela.&nbsp;</div><div>3)<span style=\"white-space:pre\">	</span>mengembangkan keberadaan masyarakat madani sebagai pengembangan kekuasaan pemerintah&nbsp;</div><div>4)<span style=\"white-space:pre\">	</span>menumbuhkan kesadaran tentang hak dan kewajiban serta tanggung jawab warga negara yang bangga terhadap negara Indonesia&nbsp;</div><div>5)<span style=\"white-space:pre\">	</span>mengembangkan kehidupan bersama yang multicultural berdasarkan nilai nilai keberagaman.&nbsp;</div><div>Fungsi wawasan nusantara ditunjukan pada nomer ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">1), 3), dan 4)&nbsp;&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">1), 3), dan 5)</span>#_#3_#_<span style=\"font-size: 12.8889px;\">1), 4), dan 5)</span>#_#4_#_<span style=\"font-size: 12.8889px;\">2), 4) dan 5)</span>#_#5_#_<span style=\"font-size: 12.8889px;\">3), 4), dan 5)</span>#_#6_#_#_#', '1'),
(52, 87, '<div>Sebagai seorang bupati, pak Tawa selalu melibatkan masyarakat umum, komunitas, dan organisasi pemuda dalam rapat pembahasan rencana pembangunan wilayah. Setiap masyarakat, komunitas maupun organisasi pemuda tersebut diberikan kesempatan untuk menyampaikan pendapat mengenai rencana pembangunan wilayah yang lebih baik. Rapat tersebut mencerminkan adanya praktek demokrasi&nbsp; ......</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">tidak langsung</span>#_#2_#_<span style=\"font-size: 12.8889px;\">perwakilan</span>#_#3_#_<span style=\"font-size: 12.8889px;\">langsung</span>#_#4_#_<span style=\"font-size: 12.8889px;\">materil</span>#_#5_#_<span style=\"font-size: 12.8889px;\">formal</span>#_#6_#_#_#', '3'),
(53, 87, '<div>Demokrasi yang dititik beratkan pada upaya menghilangkan perbedaan dalam bidang ekonomi, sedangkan persamaan dalam bidang politik kurang diperhatikan bahkan kadang-kadang dihilangkan, disebut dengan demokrasi .....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Perwakilan</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Langsung</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Formal</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Material</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Konstitusional</span>#_#6_#_#_#', '4'),
(54, 87, '<div>Demokrasi yang bersifat kekeluargaan dan kegotongroyongan yang bernapaskan Ketuhanan Yang Maha Esa, merupakan ciri dari demokrasi ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Liberal</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Langsung</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Material</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Pancasila</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Formal</span>#_#6_#_#_#', '4'),
(55, 87, '<div>Negara Indonesia sebagai negara hukum memilki kekuasaan penuh dalam menerapkan peraturan hukum bagi warga negaranya dimanapun warga negara Indonesia berada. Hal tersebut berkaitan dengan asas hukum internasional&nbsp; yang ditetapkan,&nbsp; yaitu asas ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">hukum&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">kebangsaan</span>#_#3_#_<span style=\"font-size: 12.8889px;\">keterbukaan&nbsp;</span>#_#4_#_<span style=\"font-size: 12.8889px;\">teritorial&nbsp;</span>#_#5_#_<span style=\"font-size: 12.8889px;\">kepentingan umum</span>#_#6_#_#_#', '2'),
(56, 87, '<div>Keseluruhan kaedah dan asas yang mengatur hubungan atau persoalan yang melintas batas antar negara dengan negara merupakan pengertian hukum  internasional menurut ....</div>', '#_#1_#_<i><span style=\"font-size:11.0pt;line-height:115%;\r\nfont-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\n&quot;MS Mincho&quot;;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Arial;mso-bidi-theme-font:minor-bidi;mso-ansi-language:\r\nIN;mso-fareast-language:JA;mso-bidi-language:AR-SA\">J.L Brierly&nbsp;&nbsp;</span></i><br>#_#2_#_<i>Ivan A. Shearer</i>#_#3_#_<span style=\"font-size: 12.8889px;\">Mochtar Kusumaatmadja </span>#_#4_#_<span style=\"font-size: 12.8889px;\">Wirjono Projodikoro </span>#_#5_#_<i>J.G.Starke</i>#_#6_#_#_#', '3'),
(57, 87, '<div>Perdamaian dunia pada dasarnya merupakan suatu kondisi dimana hubungan antara masyarakat, bangsa dan negara-negara di dunia berlangsung dalam kondisi aman dan damai tanpa disertai dengan pertikaian dan peperangan. Salah satu contoh peran Indonesia dalam menjaga stabilitas keamanan internasional adalah&nbsp; ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">membantu PBB melakukan serangan terhadap teroris di Irak&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">membantu negara-negara dalam mengembangkan teknologi nuklir&nbsp;</span>#_#3_#_<span style=\"font-size: 12.8889px;\">pengiriman pasukan dengan misi sebagai pasukan perdamaian PBB&nbsp;</span>#_#4_#_<span style=\"font-size: 12.8889px;\">membantu kaum minoritas dari pemerintahan negara yang otoriter&nbsp;</span>#_#5_#_<div>menekan negara Agresor tunduk terhadap resolusi Dewan Keamanan PBB&nbsp;</div>#_#6_#_#_#', '3'),
(58, 87, '<div>Latar belakang organisasi ASEAN dibentuk karena adanya persamaan nasib sebagai negara yang pernah dijajah. Adanya persamaan ini menimbulkan rasa setiakawan diantara bangsa-bangsa Asia Tenggara. Di bawah ini yang merupakan peran aktif Indonesia dalam&nbsp; ASEAN adalah&nbsp; .....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Indonesia ikut aktif dalam mempersiapkan penyelenggaraan KTT gerakan Non-Blok</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Indonesia ikut memprakarsai berdirinya ASEAN&nbsp;</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Indonesia menjadi anggota sejumlah lembaga di bawah naungan PBB&nbsp;</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Indonesia memandang pentingnya perdamaian dan stabilitas hanya di kawasan ASEAN</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Indonesia ikut aktif di ASEAN hanya dalam bidang Ekonomi&nbsp;&nbsp;</span>#_#6_#_#_#', '2'),
(59, 87, '<div>Sikap yang selalu mementingkan diri sendiri serta memandang orang lain tidak ada dan tidak bermakna merupakan ancaman dibidang sosial budaya dari luar, yang timbul sebagai akibat dari pengaruh negatif globalisasi adalah sikap ....</div>', '#_#1_#_<p><span style=\"font-size: 12.8889px;\">Hedonisme</span><br></p>#_#2_#_<span style=\"font-size: 12.8889px;\">Westernisasi</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Chauvinisme</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Etnosentrisme</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Individualisme&nbsp;</span>#_#6_#_#_#', '5'),
(60, 87, '<div>Salah satu tindakan nyata yang dapat dilakukan oleh pemerintah untuk menghadapi ancaman di bidang ekonomi, adalah....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">menjalin hubungan dengan negara luar&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">mengembangkan usaha kecil, mikro menengah, dan koperasi</span>#_#3_#_<span style=\"font-size: 12.8889px;\">mengembangkan layanan kesehatan di daerah daerah terpencil</span>#_#4_#_<span style=\"font-size: 12.8889px;\">memberi kesempatan bagi para pemuda untuk mengenyam pendidikan di luar negeri</span>#_#5_#_<div>menjalin kerja sama antar daerah dalam hal pembangunan infrastruktur&nbsp;</div>#_#6_#_#_#', '2'),
(61, 87, '<div>Indonesia merupakan negara yang sangat luas dan beragam, sehingga dalam pembangunan masih ada daerah yang tertinggal terutama di daerah yang terpencil, serta ancaman dari luar negeri. Di bawah ini yang termasuk faktor penghambat integrasi nasional adalah....</div>', '#_#1_#_<p><span style=\"font-size: 12.8889px;\">munculnya jiwa dan semangat gotong royong serta toleransi yang kuat</span><br></p>#_#2_#_<span style=\"font-size: 12.8889px;\">paham etnosentrisme</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Keinginan untuk bersatu sebagai tekad bangsa Indonesia</span>#_#4_#_<span style=\"font-size: 12.8889px;\">faktor sejarah yang mengakibatkan rasa senasib dan seperjuangan&nbsp;</span>#_#5_#_<div>Adanya semangat rela berkorban dari seluruh bangsa Indonesia</div>#_#6_#_#_#', '2'),
(62, 87, '<div>Salah satu ancaman terhadap generasi muda Indonesia adalah ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Kemajuan teknologi</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Agresi militer</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Perdagangan bebas</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Paham komunisme</span>#_#5_#_<div>Penyalahgunaan obat-obatan terlarang</div>#_#6_#_#_#', '5'),
(63, 87, '<div>Kesadaran&nbsp; berbangsa dan bernegara merupakan syarat mutlak bagi suatu bangsa agar kehidupan disuatu negara lebih harmonis, damai dan sejahtera, hal tersebut akan terwujud apabila.....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">masyarakat lebih bangga kepada budaya bangsa lain&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">masyarakat memiliki pola pikir hedonism</span>#_#3_#_<span style=\"font-size: 12.8889px;\">seluruh komponen masyarakat merasa memiliki terhadap bangsa dan negara, sehingga akan berbuat yang terbaik demi bangsa dan negara</span>#_#4_#_<span style=\"font-size: 12.8889px;\">seluruh komponen masyarakat sebagian besar bersikap apatis</span>#_#5_#_<span style=\"font-size: 12.8889px;\">sebagian besar masyarakatnya lebih mengedepankan ego-nya</span>#_#6_#_#_#', '3'),
(64, 87, '<div>Bacalah kasus berikut !</div><div>Di suatu desa&nbsp; terpencil yang kehidupan warganya bertani dan nelayan, pada umumnya kurang pendidikan dan kurang peduli terhadap hak dan kewajibannya sebagai warga negara sering terjadi pelanggaran hak warga negara dibidang politik seperti intimidasi, manipulasi data pemilih, politilk uang, dan diskriminasi dalam Pemilu oleh tim sukses dari calon kepala daerah.</div><div>Dari kasus di atas hak warga negara bidang politik yang benar adalah ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Mempengaruhi orang lain agar sesuai dengan keinginannya</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Mendapatkan perlakuan yang adil</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Mendirikan perusahaan swasta</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Mendapatkan pekerjaan dan penghidupan yang layak</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Mendapatkan perlindungan hukum</span>#_#6_#_#_#', '2'),
(65, 87, '<div>Diketahui beberapa perilaku masyarakat sebagai berikut :</div><div>1)<span style=\"white-space:pre\">	</span>Melanggar peraturan lalu lintas</div><div>2)<span style=\"white-space:pre\">	</span>Tidak membayar pajak dan distribusi</div><div>3)<span style=\"white-space:pre\">	</span>Tidak taat&nbsp; pada hukum yang berlaku</div><div>Beberapa&nbsp; perilaku di atas menunjukan adanya ...</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Kesadaran hukum</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Pengingkaran kewajiban</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Pelanggaran hak</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Nasionalisme dan partiotisme</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Pengingkaran hak</span>#_#6_#_#_#', '2'),
(66, 87, '<div>Perhatikan&nbsp; perhatikan kalimat berikut ini :</div><div>1)<span style=\"white-space:pre\">	</span>mengutamakan kepentingan negara dan masyarakat&nbsp;</div><div>2)<span style=\"white-space:pre\">	</span>tidak memaksakan kehendak kepada orang lain&nbsp;</div><div>3)<span style=\"white-space:pre\">	</span>menjaga keseimbangan hak dan kewajiban&nbsp;</div><div>4)<span style=\"white-space:pre\">	</span>hormat menghormati dan bekerjasama dengan bangsa lain&nbsp;</div><div>5)<span style=\"white-space:pre\">	</span>menerima dan melaksanakan setiap keputusan musyawarah</div><div>Contoh nilai praksis Pancasila yang sesuai dengan sila ke 4 Pancasila adalah ….</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">1), 2), dan 3)</span>#_#2_#_<span style=\"font-size: 12.8889px;\">1), 2), dan 4)</span>#_#3_#_<span style=\"font-size: 12.8889px;\">&nbsp;2), 3), dan 4)&nbsp;</span>#_#4_#_<span style=\"font-size: 12.8889px;\">1), 2), dan 5)&nbsp;</span>#_#5_#_<span style=\"font-size: 12.8889px;\">2), 3), dan 5)</span>#_#6_#_#_#', '5'),
(67, 87, '<div>Hak dan kewajiban warga negara merupakan dua hal yang saling berkaitan. Keduanya memiliki hubungan kausalitas atau hubungan sebab akibat. Di bawah ini yang menunjukan contoh hubungan kausalitas sebagai pekerja bangunan adalah ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Seseorang mendapatkan upah setelah dia melaksanakan pekerjaannya</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Seseorang mendapatkan upah sebelum dia melaksanakan pekerjaannya</span>#_#3_#_Seseorang mendapatkan nilai setelah dia mengikuti ujian sekolah<br>#_#4_#_<span style=\"font-size: 12.8889px;\">Seseorang mendapatkan nilai sebelum&nbsp; dia mengikuti ujian nasional</span><br>#_#5_#_<div>Seseorang mendapatkan barang setelah dia melakukan pembayaran</div><div><br style=\"font-size: 12.8889px;\"></div>#_#6_#_#_#', '1'),
(68, 87, '<div>Perhatikan pernyataan-pernyataan berikut !</div><div>1)<span style=\"white-space:pre\">	</span>Hukum dikatakan memaksa karena bagi siapa saja yang melanggar akan dikenai sanksi yang tegas</div><div>2)<span style=\"white-space:pre\">	</span>Hukum dikatakan memikat karena bagi siapa saja yang melanggar akan dikenai sanksi yang tegas</div><div>3)<span style=\"white-space:pre\">	</span>Hukum dikatakan memaksa karena bagi siapa saja harus menaati dan menjalankannya</div><div>4)<span style=\"white-space:pre\">	</span>Hukum dikatakan mengikat karena harus ditaati dan dijalankan oleh setiap warga tanpa kecuali.</div><div>Pernyataan yang benar ditunjukan oleh nomor ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">1 dan 2</span>#_#2_#_<span style=\"font-size: 12.8889px;\">1 dan 4</span>#_#3_#_<span style=\"font-size: 12.8889px;\">2 dan 3</span>#_#4_#_<span style=\"font-size: 12.8889px;\">3 dan 4</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Semua jawaban benar</span>#_#6_#_#_#', '2'),
(69, 87, '<div>Setiap kejahatan yang dilakukan oleh seseorang seseuai dengan hukum yang berlaku di Indonesia akan diproses secara hukum mulai dari proses penyelidikan, penyidikan, penuntutan dan persidangan di pengadilan. Pengadilan tingkat pertama yang berwenang memeriksa, mengadili, dan memutuskan perkara pidana dan perdata yang terjadi di daerah hukumnya adalah ….</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">pengadilan agama&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">pengadilan tata uasaha negara&nbsp;</span>#_#3_#_<span style=\"font-size: 12.8889px;\">pengadilan tinggi&nbsp;</span>#_#4_#_<span style=\"font-size: 12.8889px;\">pengadilan militer&nbsp;</span>#_#5_#_<span style=\"font-size: 12.8889px;\">pengadilan negeri</span>#_#6_#_#_#', '5'),
(70, 87, '<div>Hukum tumpul ke atas dan tajam ke bawah. Istilah ini sering muncul ketika masyarakat menilai proses penegakan hukum di Indonesia. Sebagai salah satu contohnya sering masyarakat membandingkan jumlah hukuman yang diterima oleh terpidana pencurian dengan koruptor yang tidak bisa mencerminkan rasa keadilan. Agar bisa memenuhi rasa keadilan seharusnya sanksi hukum bersifat ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Fleksibel mengikuti tingkat kesalahan</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Tegas</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Mengikuti peraturan perundang-undangan</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Positif</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Menjerakan pelaku kejahatan</span>#_#6_#_#_#', '2'),
(71, 87, '<div>Suatu perlindungan dapat dikatakan sebagai perlindungan hukum apabila mengandung unsur-unsur sebagai berikut,&nbsp;<b><i><span style=\"font-size:11.0pt;line-height:115%;\r\nfont-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\n&quot;MS Mincho&quot;;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Arial;mso-bidi-theme-font:minor-bidi;mso-ansi-language:\r\nIN;mso-fareast-language:JA;mso-bidi-language:AR-SA\">kecuali </span></i></b><span style=\"font-size: 11pt; line-height: 115%; font-family: Calibri, sans-serif;\">.....</span></div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Adanya perlindungan dari pemerintah kepada warganya</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Jaminan kepastian hukum</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Perlakuan sama saat sedang proses pengadilan</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Adanya sanksi hukuman bagi pihak yang melanggarnya</span>#_#5_#_<div>Berkaitan dengan hak-hak warga</div>#_#6_#_#_#', '3'),
(72, 87, '<div>Proses penegakan hukum dilakukan dalam rangka pelaksanaan norma hukum sebagai acuan perilaku bagi seluruh warga negara tanpa kecuali dalam kehidupan bermasyarakat, berbangsa dan bernegara. Dengan demikian pentingnya persamaan di dalam hukum bagi warga negara Indonesia adalah ...</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">terciptanya keadilan, ketertiban dan kepastian hukum dalam masyarakat&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">menjamin terciptanya keadilan hukum bagi para penguasa pemerintahan&nbsp;</span>#_#3_#_<span style=\"font-size: 12.8889px;\">meminimalisir pertentangan yang terjadi antarindividu dalam masyarakat</span>#_#4_#_<span style=\"font-size: 12.8889px;\">membantu aparat penegak hukum dalam menciptakan ketertiban nasional&nbsp;</span>#_#5_#_<span style=\"font-size: 12.8889px;\">melindungi segenap bangsa Indonesia dan seluruh tumpah darah Indonesia&nbsp;&nbsp;</span>#_#6_#_#_#', '1'),
(73, 87, '<div>Berikut perilaku yang harus ditaati saat berada di tempat umum,&nbsp;<b><i><span style=\"font-size:11.0pt;line-height:115%;\r\nfont-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;mso-fareast-font-family:\r\n&quot;MS Mincho&quot;;mso-fareast-theme-font:minor-fareast;mso-hansi-theme-font:minor-latin;\r\nmso-bidi-font-family:Arial;mso-bidi-theme-font:minor-bidi;mso-ansi-language:\r\nIN;mso-fareast-language:JA;mso-bidi-language:AR-SA\">kecuali</span></i></b><span style=\"font-size: 11pt; line-height: 115%; font-family: Calibri, sans-serif;\"> ....</span></div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Mencoret-coret telepon umum</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Mengantri saat membeli tiket</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Membuang sampah pada tempatnya</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Parkir di tempat yang disediakan</span>#_#5_#_<div>Tidak merokok</div><div><br style=\"font-size: 12.8889px;\"></div>#_#6_#_#_#', '1'),
(74, 87, '<div>Perkembangan dan kemajuan Iptek sangat mendukung upaya ketergantungan&nbsp; diberbagai aspek kehidupan global. Namun ada dampak negatif yang harus diwaspadai, yaitu ...</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Saling bekerja sama</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Hidup teratur</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Berdisiplin</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Bersikap individualis</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Dapat memanfaatkan waktu</span>#_#6_#_#_#', '4'),
(75, 87, '<div>Indonesia kaya akan tempat pariwisata. Oleh karena itu, salah satu bentuk iptek yang paling sesuai yang perlu dikembangkan untuk menunjang sektor tersebut ialah ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">meningkatkan pengetahuan masyarakat setempat&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">menyebarkan informasi dan pemesanan tempat pariwisata di Indonesia melalui media internet&nbsp;</span>#_#3_#_<span style=\"font-size: 12.8889px;\">meningkatkan sistem kebersihan di daerah pariwisata</span>#_#4_#_<span style=\"font-size: 12.8889px;\">membangun infrastruktur</span>#_#5_#_<span style=\"font-size: 12.8889px;\">meningkatkan SDM dalam hal pelayanan&nbsp;</span>#_#6_#_#_#', '2'),
(76, 87, '<div>Penggunaan komputer dalam mengerjakan tugas yang dahulu dilakukan secara manual dan membutuhkan waktu yang lama, sekarang dapat dikerjakan dengan mudah dan dalam waktu yang relatif cepat merupakan pengaruh positif iptek dalam aspek kehidupan, yaitu ...</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Pendidikan</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Sosial budaya</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Ekonomi</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Politik</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Pertahanan dan keamanan</span>#_#6_#_#_#', '1');
INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(77, 87, '<div>Sikap memiliki dan menentukan alternatif yang terbaik bagi kehidupan diri, lingkungan masyarakat, bangsa, dan negara melalui proses yang berhati-hati, rasional, dan normatif terhadap segala macam pengaruh dari luar sehingga apa yang telah menjadi pilihan dapat diterima oleh semua pihak dengan penuh tanggung jawab disebut sikap ...</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Apatis</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Individualis</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Selektif</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Apriori</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Etnosentris</span>#_#6_#_#_#', '3'),
(78, 87, '<div>Peranan pelajar dalam pembangunan nasional terhadap pengaruh budaya luar dan iptek, yaitu ...</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Menabung untuk masa depan</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Ikut serta melestarikan lingkungan</span>#_#3_#_<div style=\"text-align: justify; text-indent: -24px;\">&nbsp; &nbsp;Meningkatkan kreativitas kemandirian dan iptek</div>#_#4_#_<span style=\"font-size: 12.8889px;\">Melaksanakan program pemerintah</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Mampu mengendalikan diri dalam pergaulan</span>#_#6_#_#_#', '3'),
(79, 87, '<div>Dalam pelaksanaan otonomi daerah ada sebuah penyerahan wewenang dari pemerintah pusat kepada pemerintah daerah untuk mengatur dan mengurus rumah tangga daerahnya sendiri disebut asas ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">sentralisasi&nbsp;&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">desentralisasi</span>#_#3_#_<span style=\"font-size: 12.8889px;\">tugas pembantuan</span>#_#4_#_<span style=\"font-size: 12.8889px;\">dekonsentrasi</span>#_#5_#_<p><span style=\"font-size: 12.8889px;\">sentralistik&nbsp;</span><br></p>#_#6_#_#_#', '2'),
(80, 87, '<div>Negara Indonesia sebagai negara yang sudah merdeka sejak tanggal 17 Agustus 1945, serta sudah memiliki pemerintahan yang sah. Dimana Belanda datang ke Indonesia untuk menguasai dan mempengaruhi negara Indonesia yang ingin merubah bentuk negara. Karena keberhasilan Belanda mempengaruhi Indonesia, yang akhirnya Belanda dan Indonesia melaksanakan perjanjian KMB (Konferensi Meja Bundar), dari hasil perjanjian KMB, sejak 27 Desember 1949 Indonesia berubah&nbsp; bentuk&nbsp; negaranya menjadi&nbsp; ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">Kesatuan</span>#_#2_#_<span style=\"font-size: 12.8889px;\">Serikat</span>#_#3_#_<span style=\"font-size: 12.8889px;\">Konfederasi</span>#_#4_#_<span style=\"font-size: 12.8889px;\">Dominion</span>#_#5_#_<span style=\"font-size: 12.8889px;\">Bagian</span>#_#6_#_#_#', '2'),
(81, 87, '<div>Pak Sasa seorang pejabat sebuah pemerintahan dan merupakan anggota aparatur negara, ia memiliki prinsip bahwa anak atau saudaranya harus bisa menjadi aparatur negara juga melalui bantuannya karena ia merasa memilki wewenang untuk mengangkatnya. Pemikiran pak Sasa tersebut sangat merugikan bagi para calon pegawai pemerintahan yang ingin mendapatkan kesempatan tersebut. Hal tersebut merupakan tindakan yang dapat dianggap penyelewengan jabatan, yaitu ...</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">korupsi</span>#_#2_#_<span style=\"font-size: 12.8889px;\">kolusi</span>#_#3_#_<span style=\"font-size: 12.8889px;\">nepotisme</span>#_#4_#_<span style=\"font-size: 12.8889px;\">sentralisasi</span>#_#5_#_<span style=\"font-size: 12.8889px;\">demokrasi</span>#_#6_#_#_#', '3'),
(82, 87, '<div>Presiden hanya berfungsi sebagai kepala Negara dan tidak dapat diganggu gugat sedangkan kepala Pemerintahaan berada ditangan perdana menteri merupakan ciri dari sistem pemerintahan ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">monarki konstitusi&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">monarki parlementer&nbsp;</span>#_#3_#_<span style=\"font-size: 12.8889px;\">republik konstitusional&nbsp;</span>#_#4_#_<span style=\"font-size: 12.8889px;\">republik absolut&nbsp;</span>#_#5_#_<div>republik&nbsp; parlementer</div>#_#6_#_#_#', '5'),
(83, 87, '<div>Pahami tugas-tugas presiden berikut!:&nbsp;</div><div>(1). Memegang kekuasaan pemerintahan menurut UUD,</div><div>(2). Mengajukan RUU kepada DPR,&nbsp;</div><div>(3). Menetapkan peraturan pemerintah untuk menjalankan undang-undang,&nbsp;</div><div>(4). Memberi grasi dan rehabilitasi dengan memperhatikan pertimbangan MA.&nbsp;</div><div>Dari data di atas yang merupakan tugas presiden dalam bidang eksekutif ditunjukkan pada nomor ....</div>', '#_#1_#_<span style=\"font-size: 12.8889px;\">1 dan 2&nbsp;</span>#_#2_#_<span style=\"font-size: 12.8889px;\">1 dan 3&nbsp;</span>#_#3_#_<span style=\"font-size: 12.8889px;\">1 dan 4&nbsp;</span>#_#4_#_<span style=\"font-size: 12.8889px;\">2 dan 4&nbsp;</span>#_#5_#_<span style=\"font-size: 12.8889px;\">4 dan 3</span>#_#6_#_#_#', '2');
INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(84, 88, '<p><span style=\"font-size: 13.7078px;\">Allah telah memerintahkan umat Islam untuk menjauhi tiga perkara buruk yang diisayaratkan dalam firman Allah Q.S. al Hujurat/49: 12. yang berbunyi:</span></p><p><img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 100%;\"><span style=\"font-size: 13.7078px;\"><br></span></p><p>Berdasarkan potongan ayat tersebut, perkara buruknya adalah .....<br></p>', '#_#1_#_<div>Berbuat ghibah (membicakan orang lain), berprasangka buruk pada saudara seiman dan berprasangka baik pada teman<br></div><div><br></div>#_#2_#_Bersuudzon kepada pada saudara seiman, mencari-cari kesalahan orang lain untuk dijatuhkan reputasinya dan berghibah (membicarakan orang lain)#_#3_#_Mencuri dengan mengambil hak orang lain, mencari-cari kesalahan orang lain dan senang menggosipkan orang lain#_#4_#_Membunuh sebagai bentuk mengambil hak hidup orang lain, merusak ketenangan sesama umat beragama dan menggunjing#_#5_#_Mempublikasikan berita tidak benar, menghalalkan segala cara untuk meraih kemenangan dan popularitas#_#6_#_#_#', '2');
INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(85, 88, '<div><span style=\"font-size: 13.7078px;\">Di era teknologi saat ini, kita semakin mudah untuk mendapatkan berbagai informasi. Mulai dari informasi yang sangat kita butuhkan, hingga informasi yang sama sekali tidak kita butuhkan. Misalnya saja kehidupan privasi para artis di Indonesia. Baik di televisi, radio, surat kabar bahkan dengan mudahnya kita mendapatkan informasi dari berbagai media sosial. Beradasarkan narasi tersebut, sikap yang paling tepat untuk mengimplementasikan Q.S. al-Hujurat ayat 12 dalam kehidupan sehari-hari adalah ....</span></div>', '#_#1_#_menyadarkan para artis dengan memberi komentar yang tegas#_#2_#_mengikuti gaya hidup artis dengan cara berlebihan#_#3_#_berusaha agar tidak ketinggalan informasi tentang kabar artis terkini#_#4_#_berhati-hati sebelum menirukan artis yang diidolakan#_#5_#_mencari-cari kesalahan artis yang tidak disenangi.#_#6_#_#_#', '4'),
(86, 88, '<div><span style=\"font-size: 13.7078px;\">Cermati Q.S&nbsp; Al-Isra /17: 32 berikut ini!</span></div><div><span style=\"font-size: 13.7078px;\"><br></span></div><div><img src=\"data:image/png;base64,\" alt=\"\" style=\"font-size: calc(12px + 2 * ((100vw - 600px) / 540)); width: 100%;\"><br></div><div><span style=\"font-size: 13.7078px;\"><br></span></div><div><span style=\"font-size: 13.7078px;\">Hukum bacaan tajwid yang bergaris bawah&nbsp; tersebut adalah…</span></div>', '#_#1_#_(1) Al qamariyah, (2) mad thabi’i dan&nbsp; (3) idgham bigunnah#_#2_#_(1) Al syamsiyah,&nbsp; (2) mad thabi’i dan&nbsp; (3) idgham bigunnah#_#3_#_(1) Al qamariyah, (2) mad thabi’i dan (3) idgham bilagunnah#_#4_#_(1) Al qamariyah, (2)&nbsp; mad lain dan (3) idgham bilagunnah#_#5_#_(1) Al syamsiyah, (2) mad thabi’i dan (3) idgham bilagunnah#_#6_#_#_#', '2');
