INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(88, 88, '<div><span style=\"font-size: 13.7078px;\">Cermati penggalan Q.S. Al Maidah/ 5: 32 berikut:</span></div><div><img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 100%;\"><span style=\"font-size: 13.7078px;\"><br></span></div><div><span style=\"font-size: 13.7078px;\"><br></span></div><div>Kandungan firman Allah SWT., yang mengisyaratkan larangan tindakan pengrusakan dan memelihara kehidupan manusia dimuka bumi dapat direalisasikan dengan. …</div>', '#_#1_#_melaksanakan shalat lima waktu di awal waktu#_#2_#_melaksanakan shalat tahajud pada sepertiga malam#_#3_#_memberikan santunan kepada anak yatim piatu#_#4_#_berpuasa sunah setiap hari senin dan kamis#_#5_#_membaca al-Quran setiap hari di rumah dan di masjid#_#6_#_#_#', '3'),
(89, 88, '<span style=\"font-size: 13.7078px;\">Prof. Dr. Quraish Shihab mengelompokan kaum musyrikin ke dalam dua golongan, yaitu ada orang yang percaya kepada al qur’an, tetapi menolak kebenaran al-Qur’an karena keras kepala dan demi mempertahankan kedudukan sosialnya. Dan ada yang memang benar-benar lahir dan batin tidak percaya kepada al qur’an serta enggan memerhatikannya karena hati mereka telah terkunci. Penjelasan ini didapatkan dari potongan ayat. …</span>', '#_#1_#_<img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 321.667px; height: 27.1001px;\">#_#2_#_<img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 331.667px; height: 44.9512px;\">#_#3_#_<img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 216.21px; height: 44.5139px;\">#_#4_#_<img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 299.667px; height: 45.0049px;\">#_#5_#_<img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 321.667px; height: 45.9524px;\">#_#6_#_#_#', '1');
INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(90, 88, '<p><span style=\"font-size: 13.7078px;\">Perhatikan Q.S. Ali-Imran/3:159 berikut!</span></p><p><img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 100%;\"><span style=\"font-size: 13.7078px;\"><br></span></p><p><span style=\"font-size: 13.7078px;\">Makna penggalan ayat yang bergaris bawah adalah….</span></p>', '#_#1_#_lemah lembut<br>#_#2_#_bertawakal#_#3_#_maafkanlah#_#4_#_bersikap keras#_#5_#_berhati kasar#_#6_#_#_#', '1');
INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(91, 88, '<p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:18.0pt;mso-add-space:auto;text-align:justify;text-indent:-18.0pt;\r\nline-height:150%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:IN\">Perhatikan Q.S. Luqman/31: 14 berikut!</span></p><p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:18.0pt;mso-add-space:auto;text-align:justify;text-indent:-18.0pt;\r\nline-height:150%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;line-height:150%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-ansi-language:IN\"><img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 100%;\"></span></p><p class=\"MsoListParagraph\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:\r\n0cm;margin-left:18.0pt;mso-add-space:auto;text-align:justify;text-indent:-18.0pt;\r\nline-height:150%;mso-list:l0 level1 lfo1\"><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Perilaku yang sejalan dengan pesan ayat di atas adalah……</span></font></p>', '#_#1_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px; text-align: justify; text-indent: -24px;\">Rian menjenguk tetangga yang sakit</span>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px; text-align: justify; text-indent: -24px;\">Umar senantiasa menghormati kedua orang tuanya</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px; text-align: justify; text-indent: -24px;\">Bintang senantiasa menyantuni anak yatim</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px; text-align: justify; text-indent: -24px;\">Rijal setiap hari bersedekah kepada fakir miskin</span>#_#5_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px; text-align: justify; text-indent: -24px;\">Fajar ketika berbicara sopan kepada guru</span>#_#6_#_#_#', '2'),
(92, 88, '<div><span style=\"font-size: 13.7078px;\">Berikut adalah pernyataan-pernyataan dalam kehidupan kita sehari-hari;</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Adi membantu teman yang sedang kesulitan, tanpa membeda-bedakan.</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Ketua OSIS memberikan kesempatan yang sama kepada teman untuk berpendapat.</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Mariam melaksanakan tugas piket harian di sekolah sesuai dengan jadwal.</span></div><div><span style=\"font-size: 13.7078px;\">Beradasarkan ketiga pernyataan di atas, manakah sifat Allah Swt dalam al-asma al-husna yang sesuai. …</span></div>', '#_#1_#_Al-’Adl#_#2_#_Al-Matin#_#3_#_Al-Karim#_#4_#_Al-Mukmin#_#5_#_Al-Wakil#_#6_#_#_#', '1'),
(93, 88, '<div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Fatimah meyakini bahwa ada malaikat yang bertugas mengatur rezeki. Ia yakin bahwa malaikat akan memudahkan urusan rezekinya selama ia mau berusaha dan berdoa. Ia pantang berputus asa dan berpangku tangan karena memang Allah Swt. tidak akan menurunkan harta benda dengan menjatuhkannya begitu saja dari langit.&nbsp;</span></font></div><div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Dari contoh perilaku di atas menunjukkan bahwa Fatimah meyakini akan adanya malaikat. …</span></font></div>', '#_#1_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Jibril</span>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Mikail</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Raqib</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Atid</span>#_#5_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Israfil</span>#_#6_#_#_#', '2'),
(94, 88, '<div><span style=\"font-size: 13.7078px;\">Al-Qur’an di turunkan Allah Swt. kepada Nabi Muhammad saw. Melalui Malaikat Jibril. Al-Qur’an diturunkan tidak sekaligus, melainkan secara berangsurangsur. Waktu turun al-Qur’an selama kurang lebih. …</span></div>', '#_#1_#_22 tahun 1 bulan 22 hari#_#2_#_22 tahun 2 bulan 22 hari#_#3_#_22 tahun 3 bulan 22 hari#_#4_#_22 tahun 4 bulan 22 hari#_#5_#_22 tahun 5 bulan 22 hari#_#6_#_#_#', '2'),
(95, 88, '<div><font face=\"KFGQPC Uthmanic Script HAFS\"><span style=\"font-size: 21.3333px;\">Cermati penggalan surah di bawah ini!&nbsp;</span></font></div><div><img src=\"data:image/png;base64,\" alt=\"\" style=\"font-size: calc(12px + 2 * ((100vw - 600px) / 540)); width: 355.667px; height: 92.4994px;\"><br></div><div><font face=\"KFGQPC Uthmanic Script HAFS\"><span style=\"font-size: 21.3333px;\"><br></span></font></div><div><font face=\"KFGQPC Uthmanic Script HAFS\"><span style=\"font-size: 21.3333px;\">Dalam Q.S. az-Zalzalah/99:1 di atas dijelaskan bahwa peristiwa terjadinya kiamat dimulai dengan…..</span></font></div><div><br></div>', '#_#1_#_<span style=\"font-family: &quot;KFGQPC Uthmanic Script HAFS&quot;; font-size: 21.3333px;\">matahari digulung</span>#_#2_#_<span style=\"font-family: &quot;KFGQPC Uthmanic Script HAFS&quot;; font-size: 21.3333px;\">bintang-bintang berjatuhan</span>#_#3_#_<span style=\"font-family: &quot;KFGQPC Uthmanic Script HAFS&quot;; font-size: 21.3333px;\">gunung-gunung dihancurkan</span>#_#4_#_<span style=\"font-family: &quot;KFGQPC Uthmanic Script HAFS&quot;; font-size: 21.3333px;\">manusia bagaikan anai-anai yang bertebaran</span>#_#5_#_<span style=\"font-family: &quot;KFGQPC Uthmanic Script HAFS&quot;; font-size: 21.3333px;\">bumi digoncangkan dengan goncangan yang dahsyat</span>#_#6_#_#_#', '5'),
(96, 88, '<div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Hari kiamat pasti akan datang, tetapi tidak ada satu makhlukpun yang dapat mengetahui kapan datangnya. Al-Quran dan hadits hanya menjelaskan tanda-tanda hari kiamat, baik tanda alam ataupun tanda-tanda kemerosotan akhlak. Pernyataan di bawah ini yang merupakan tanda hari kiamat berupa kerusakan akhlak adalah ... .&nbsp;</span></font></div>', '#_#1_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">keluarnya dajjal</span>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">terbitnya matahari dari arah barat</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">datangnya bangsa Ya’jud dan Ma’jud</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">minuman keras dan perzinahan merajarela</span>#_#5_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">munculnya binatang yang dapat bicara dengan manusia</span>#_#6_#_#_#', '4'),
(97, 88, '<div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Indonesia sudah berhasil kendalikan pandemi Covid-19 dan kini masuk fase endemi. Peralihan ke fase endemi ini disebut dapat terwujud karena adanya kekebalan tubuh.Tingkat keparahan penyakit dari infeksi Covid-19 dapat ditekan hingga ke level yang tidak signifikan. Salah satu faktor yang bisa menekan itu adalah kekebalan tubuh. Kalau saja semua penduduk mempunyai kekebalan, maka orang yang terinfeksi pun tidak akan bergejala atau tidak akan masuk rumah sakit, dan tidak akan menjadi berat apalagi meninggal dunia. Faktor lainnya yakni masyarakat harus tetap menjaga diri dengan memberlakukan pola hidup sehat.</span></font></div><div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Sesuai narasi tersebut, berikut ini yang merupakan perilaku beriman pada qadha dan qadar&nbsp; adalah. …&nbsp;</span></font></div>', '#_#1_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">tidak perlu memberlakukan pola hidup sehat, karena sakit itu merupakan takdir</span>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">berdiam diri di dalam rumah dan tidak beraktivitas untuk menghindari virus&nbsp;</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">berkeyakinan bahwa musibah ini datang dari Allah Swt., dan tetap berikhtiar dengan pola hidup sehat</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">menyerahkan sepenuhnya kepada Allah Swt., sambil menunggu bantuan dari orang lain</span>#_#5_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">tidak perlu khawatir berlebihan terhadap karena takdir Allah yang menentukan segalanya</span>#_#6_#_#_#', '3'),
(98, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan beberapa pernyataan berikut1</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Ibu Edoh sampai tua tetap bekerja, karena dia berprinsip bahwa bekerja itu ibadah.&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Ratna mengerutu ketika mendapatkan nilai jelek, karena dia merasa paling pandai di kelasnya.</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Purnomo bekerja dengan tekun agar mendapatkan hasil yang maksimal, karena taqdir harus diusahakan.</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Arfan tetap semangat belajar, karena dia merasa masih kurang dalam menguasai materi pembelajaran dan nilainya kurang baik.</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Agnes hilang semangat&nbsp; dalam menjalani hidupnya, karena sakit yang dideritanya sejak lama tidak kunjung sembuh sampai saat ini.</span></div><div><span style=\"font-size: 13.7078px;\">Berdasarkan pernyataan-pernyataan tersebut, perilaku yang mencerminkan iman kepada Qada dan Qadar terdapat pada nomor ....</span></div>', '#_#1_#_1, 2, dan 3#_#2_#_1, 4, dan 5#_#3_#_1, 3, dan 4#_#4_#_2, 4, dan 5#_#5_#_3, 4, dan 5#_#6_#_#_#', '3'),
(99, 88, '<div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Allah SWT. telah menggariskan hukum-Nya dalam qada dan qadar. Dengan pemahaman yang benar kita mampu menjadi pribadi yang kuat dan optimis. Untuk mencapai hal tersebut, usaha yang harus dilakukan adalah …..</span></font></div>', '#_#1_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">bersikap sombong</span>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">menjadikan sesuatu dengan sia-sia</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">mengasingkan diri dengan dunia luar</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">memiliki prasangka buruk kepada orang lain</span>#_#5_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">melakukan doa dan ikhtiar serta tawakal</span>#_#6_#_#_#', '5'),
(100, 88, '<div><span style=\"font-size: 13.7078px;\">Pakaian yang dikenakan seorang wanita&nbsp; hendaknya ialah pakaian yang menutup seluruh tubuhnya kecuali pada bagian muka dan telapak tangan. Agama Islam menaruh perhatian yang sangat besar terhadap perempuan, hal ini semata-mata karena islam sangat memuliakan wanita.</span></div><div><span style=\"font-size: 13.7078px;\">Berikut ketentuan berpakaian menurut syari’at untuk wanita adalah …..</span></div>', '#_#1_#_menunjukkan lekukan tubuh#_#2_#_memakai hiasan berlebihan dan mewah#_#3_#_pakaian yang tidak mengundang syahwat#_#4_#_menyerupai pakaian yang berjenis kelamin berbeda#_#5_#_memakai bahan yang tipis#_#6_#_#_#', '3');
INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(101, 88, '<div><span style=\"font-size: 13.7078px;\">Ketika seseorang mengikrarkan diri, menjadikan Islam sebagai keyakinannya, dengan mengucapkan dua kalimat syahadat, berarti dia telah membenarkan ajaran Islam, dan pertanda pula bahwa dia siap untuk berkomitmen terhadap ajaran-ajaran Islam. Dalam salat subuh contohnya, seorang muslim selalu mengerjakannya sebanyak dua raka’at, karena syariat memerintahkannya demikian sehingga apapun kondisinya, seperti di tempat yang sepi, dia akan tetap mengerjakannya dua rakaat.&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">Keutamaan perilaku jujur dari narasi diatas adalah…..</span></div>', '#_#1_#_Kejujuran adalah salah satu tingkatan Iman dan Islam#_#2_#_Kejujuran akan membimbing pada kebaikan#_#3_#_Jujur memberikan rasa nyaman dan hati tenang#_#4_#_Jujur akan menyelamatkan dari azab dan laknat Allah Swt#_#5_#_Jujur merupakan penyempurna iman seorang muslim#_#6_#_#_#', '5'),
(102, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan di bawah ini :</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Memiliki keteguhan hati</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Memiliki kekuatan pendirian</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Jujur pada diri sendiri</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Mempertahankan kebenaran</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Peduli terhadap orang lain</span></div><div><span style=\"font-size: 13.7078px;\">Yang termasuk ke dalam makna syaja’ah adalah</span></div>', '#_#1_#_1, 2 dan 3#_#2_#_1,2 dan 4#_#3_#_1,2 dan 5#_#4_#_2,3 dan 4#_#5_#_3,4 dan 5#_#6_#_#_#', '2'),
(103, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan beberapa pernyataan di bawah ini !</span></div><div><span style=\"font-size: 13.7078px;\">1.<span style=\"white-space:pre\">	</span>Mendengarkan semua perkataannya dengan penuh rasa hormat dan rendah hati.</span></div><div><span style=\"font-size: 13.7078px;\">2.<span style=\"white-space:pre\">	</span>Menyambung tali silaturahim dengan kerabat dan sahabat orang tua.</span></div><div><span style=\"font-size: 13.7078px;\">3.<span style=\"white-space:pre\">	</span>Membantu pekerjaan rumah atau pekerjaan lain yang dapat meringankan beban orang tua.</span></div><div><span style=\"font-size: 13.7078px;\">4.<span style=\"white-space:pre\">	</span>Senantiasa meminta doa restu</span></div><div><span style=\"font-size: 13.7078px;\">5.<span style=\"white-space:pre\">	</span>Melanjutkan cita-cita orang tua.</span></div><div><span style=\"font-size: 13.7078px;\">6.<span style=\"white-space:pre\">	</span>Memberi nafkah jika sudah tidak mampu manafkahi dirinya sendiri</span></div><div><span style=\"font-size: 13.7078px;\">7.<span style=\"white-space:pre\">	</span>Mendoakan ayah dan ibu dengan memintakan ampun kepada Allah Swt.</span></div><div><span style=\"font-size: 13.7078px;\">Cara menghormati dan taat kepada orang tua yang masih hidup ditunjukkan pada nomor.....&nbsp;</span></div>', '#_#1_#_1, 2, 3, 4 dan 5#_#2_#_1, 2, 3, 5 dan 6#_#3_#_1, 3, 4, 6 dan 7#_#4_#_1, 3, 5, 6 dan 7#_#5_#_1, 2, 3, 4 dan 7#_#6_#_#_#', '3'),
(104, 88, '<div><span style=\"font-size: 13.7078px;\">Lengkapilah terjemahan hadist berikut ini!</span></div><div><span style=\"font-size: 13.7078px;\">“Tidak ada seorang yang memakan satu makanan pun yang lebih baik dari makanan hasil …..” (HR. Bukhari)</span></div>', '#_#1_#_mencuri#_#2_#_usaha orang tuanya#_#3_#_jerih payahnya#_#4_#_pekerjaannya sendiri#_#5_#_usaha tangannya sendiri#_#6_#_#_#', '5'),
(105, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan kisah berikut ini!</span></div><div><span style=\"font-size: 13.7078px;\">Sudarno, lelaki bertubuh kerempeng ini berjalan menuju sebuah gedung. Tawaran untuk jadi tukang sapu langsung diambilnya tanpa pikir panjang. Karena kinerjanya bagus, kariernya menanjak hingga diangkat menjadi penanggung jawab gudang. Selama bekerja di kantor, ia mencari penghasilan tambahan dengan berjualan kaos kaki, sarung tangan dan lain-lain. Karena usahanya semakin sukses, ia memutuskan untuk mengundurkan diri dari kantornya. Dan saat ini omset penjualan mencapai 50 juta per bulan.&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">Berdasarkan kisah tersebut, nilai keteladanan dari sosok Sudarno adalah ….</span></div>', '#_#1_#_Semangat menuntut ilmu#_#2_#_Berani memilih kekayaan#_#3_#_Berkata sesuai kenyataan#_#4_#_Bekerja keras dengan penuh semangat#_#5_#_Mengutamakan kepentingan perusahaan#_#6_#_#_#', '4'),
(106, 88, '<div><span style=\"font-size: 13.7078px;\">Allah dan Rasul telah memerintahkan kepada kita untuk membiasakan perilaku bekerja keras dan tidak boleh berimajinasi saja atau bergantung pada orang lain dengan cara meminta-minta. Agar kita mendapatkan hasil kerja yang baik, kita harus memiliki motivasi atau semangat, rajin, tekun dan ulet dengan maksud agar berhasil dan dapat mencukupi kebutuhan hidup. Dari narasi tersebut dapat disimpulkan perilaku kerja keras dalam kehidupan sehari-hari adalah …</span></div>', '#_#1_#_selalu berkonsultasi dengan para ahli dalam menyelesaikan perkerjaan#_#2_#_menggunakan bantuan media sosial untuk berkerja mencari nafkah#_#3_#_belajar dengan tekun sepanjang malam untuk menghadapi ujian besok#_#4_#_bekerja sampai larut malam tanpa memperhatikan kesehatan fisik#_#5_#_mengerjakan tugas sekolah dengan semangat, teliti dan tepat waktu#_#6_#_#_#', '5'),
(107, 88, '<div><span style=\"font-size: 13.7078px;\">Perilaku kerja keras sudah dicontohkan oleh Nabi Muhammad Saw. Beliau tidak hanya menghabiskan waktu untuk mengingat Allah saja, tetapi bekerja keras dengan cara berdagang. Berdasarkan hal tersebut, kita dapat mencontoh Nabi bahwa kita diperintahkah oleh Allah dan Rasul-Nya untuk membiasakan perilaku bekerja keras.</span></div><div><span style=\"font-size: 13.7078px;\">Dari deskripsi tersebut dapat disimpulkan yang tidak termasuk hikmah kerja keras dalam kehidupan sehari-hari adalah…</span></div>', '#_#1_#_mengangkat harkat martabat diri baik sebagai makhluk individu maupun sebagai masyarakat;#_#2_#_meningkatkan taraf hidup dan meningkatkan kesejahteraan#_#3_#_membentuk pribadi yang kurang disiplin dan bertanggung jawab#_#4_#_<div>mendorong untuk hidup mandiri dan tidak menjadikannya beban bagi orang lain</div>#_#5_#_memenuhi kebutuhan hidup diri dan keluarga terpenuhi#_#6_#_#_#', '3'),
(108, 88, '<div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Kitab suci Al-Quran sebagai sumber hukum Islam yang pertama mensyariatkan salah satunya tentang kewajiban mendirikan salat bagi orang yang beriman, namun tentang bagaimana kaifiyat atau tata cara pelaksanaan salat lima waktu tidak dijelaskan secara rinci dan detail di dalamnya. Tentu saja secara teknis perlu memahami sumber hukum yang kedua yakni Hadits. Berdasarkan narasi di atas fungsi Hadits terhadap Al-Qur’an adalah. …</span></font></div>', '#_#1_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">menentukan hukum yang tidak terdapat dalam Al-Quran</span>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">merinci hukum dalam Al-Quran yang masih bersifat global&nbsp;</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">membatasi hukum yang belum ada batasnya dalam Al-Quran</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">memperkuat hukum yang sudah ditetapkan oleh Al-Quran</span>#_#5_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">membatalkan hukum yang sudah ditetapkan oleh Al-Quran</span>#_#6_#_#_#', '2'),
(109, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan tata cara mensalatkan jenazah berikut ini:</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Takbir empat kali</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Membaca doa untuk jenazah</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Imam menghadap ke arah perut jenazah</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Imam menghadap ke arah kepala jenazah</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Membaca surah Al-Fatihah setelah takbir pertama</span></div><div><span style=\"font-size: 13.7078px;\">6)<span style=\"white-space:pre\">	</span>Membaca surat-surat pendek setelah takbir ketiga</span></div><div><span style=\"font-size: 13.7078px;\">Yang termasuk ketentuan dan tata cara mensalatkan jenazah laki-laki ditunjukkan pada nomor. …</span></div>', '#_#1_#_1), 2), 4) dan 5)#_#2_#_1), 2), 4) dan 6)#_#3_#_1), 2), 3) dan 4)#_#4_#_2), 3), 4) dan 5)#_#5_#_2), 4), 5) dan 6)#_#6_#_#_#', '1'),
(110, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan ketentuan pernikahan berikut:</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Calon mempelai laki-laki</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Calon mempelai perempuan</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Adanya wali nikah</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Dua orang saksi</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Shigat (Ijab Qobul)</span></div><div><span style=\"font-size: 13.7078px;\">6)<span style=\"white-space:pre\">	</span>Mahar</span></div><div><span style=\"font-size: 13.7078px;\">7)<span style=\"white-space:pre\">	</span>Penghulu</span></div><div><span style=\"font-size: 13.7078px;\">Berdasarkan ketentuan tersebut, yang merupakan rukun pernikahan dalam Islam adalah …</span></div>', '#_#1_#_1), 2), 3), 4) dan 5)#_#2_#_1), 2), 3), 4) dan 6)#_#3_#_1), 2), 4), 5) dan 6)#_#4_#_1), 3), 4), 5) dan 7)#_#5_#_1), 3), 4), 6) dan 7)#_#6_#_#_#', '1'),
(111, 88, '<div><span style=\"font-size: 13.7078px;\">Keluarga pa Rahman terdiri dari bu Endah sebagai istri, Ranita sebagai anak perempuan, Torik sebagai anak-anak laki-laki dan Zidan sebagai anak angkat, serta Rahim sebagai adik kandung pa Rahman. Jika pa Rahman wafat siapakah diantara ahli waris di atas yang berfungsi sebagai Asobah Binnafsi?</span></div>', '#_#1_#_Endah dan Ranita#_#2_#_Torik dan Rahim#_#3_#_Torik dan Zidan#_#4_#_Ranita dan Torik#_#5_#_Rahim dan Zidan#_#6_#_#_#', '4'),
(112, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan di bawah ini!</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>dapat menyucikan jiwa dari sifat serakah dan bakhil&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>dapat menimbulkan kekaguman masyarakat sekitar&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>mendapatkan pahala yang berlipat di sisi Allah Swt</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>dapat menjadikan perubahan sosial para mustahik</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>dapat mengangkat derajat pemilik harta dengan berkah,&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">Dari pernyataan di atas, dapat disimpulkan yang termasuk hikmah zakat bagi muzakki adalah …</span></div>', '#_#1_#_(1), (2) dan (3)#_#2_#_(1), (2) dan (4)#_#3_#_(1), (3) dan (4)#_#4_#_(1), (3) dan (5)#_#5_#_(1), (4) dan (5)#_#6_#_#_#', '4'),
(113, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan berikut!</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Mengucapkan salam</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Mengucapkan hamdalah</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Mengucapkan syahadat</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Mengucapkan shalawat</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Menyampaikan pesan takwa</span></div><div><span style=\"font-size: 13.7078px;\">6)<span style=\"white-space:pre\">	</span>Membaca istighfar</span></div><div><span style=\"font-size: 13.7078px;\">Dari pernyataan di atas, dapat disimpulkan yang termasuk rukun khutbah jum’at adalah. …</span></div>', '#_#1_#_1, 2, 3, dan 4#_#2_#_2, 3, 4 dan 5#_#3_#_3, 4, 5 dan 6#_#4_#_1, 3, 4 dan 5#_#5_#_1, 3, 4 dan 6#_#6_#_#_#', '2'),
(114, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan berikut!</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Terpeliharanya kehormatan suami istri dari perbuatan zina&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Mendapatkan keturunan yang sah dari hasil pernikahan</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Pasangannya tidak sesuai dengan agama yang dianut</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Terwujudnya ketenteraman, kasih sayang, dan cinta</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Terciptanya hubungan antara laki-laki dan perempuan yang bukan mahram&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">Dari pernyataan di atas, dapat disimpulkan yang termasuk hikmah pernikahan adalah. ...</span></div>', '#_#1_#_1), 2) dan 3)#_#2_#_1), 2) dan 4)#_#3_#_1), 3) dan 5)#_#4_#_2), 3) dan 4)#_#5_#_2), 3) dan 5)#_#6_#_#_#', '2'),
(115, 88, '<div><span style=\"font-size: 13.7078px;\">Jika ahli waris yang ditnggalkan seorang istri, nenek, ibu, 1 anak laki-laki, dan 2 anak perempuan, dengan harta waris sebesar Rp. 480 juta, berapakah bagian anak laki-laki dalam rupiah?</span></div>', '#_#1_#_60.000.000#_#2_#_80.000.000#_#3_#_100.000.000#_#4_#_170.000.000#_#5_#_250.000.000#_#6_#_#_#', '4'),
(116, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan-pernyataan di bawah ini !</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Telah datang 13 orang penduduk Madinah menemui Rasulullah saw. di Bukit Aqabah. Mereka berikrar memeluk agama Islam</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>penghianatan orang-orang Yahudi kepada Rasulullah Saw dan pengikutnya</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>siksaan yang diterima Rasulullah dan orang muslim dari orang-orang kafir Quraisy semakin berat.</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Ka’bah dijadikan tempat pemujaan berhala oleh kafir Quraisy</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>pemboikotan yang dilakukan oleh kafir Quraisy kepada Rasulullah Saw dan pengikutnya.</span></div><div><span style=\"font-size: 13.7078px;\">Dari pernyataan tersebut, dapat disimpulkan yang termasuk faktor pendorong Rasulullah Saw&nbsp; hijrah ke Madinah adalah....</span></div>', '#_#1_#_1,2, dan 3#_#2_#_1,2, dan 4#_#3_#_1,3, dan 5#_#4_#_2,3, dan 4#_#5_#_2,3, dan 5#_#6_#_#_#', '5'),
(117, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan berikut ini:</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Umat Islam sangat konsisten dan istiqamah kepada Islam sebagai hasil dari proses telaah dan kajian yang mendalam.</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Motivasi ajaran Islam agar umatnya unggul, maju, dan berkualitas dalam segala aspek kehidupan.</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Adanya hubungan yang dinamis antara kebudayaan Arab (Islam) dengan kebudayaan lain yang telah maju sebelum datangnya ajaran Islam, misalnya Mesir, Babylonia, Yunani, India, dan Persia.</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Ajaran Islam yang membawa keseimbangan antara capaian lahir dan batin, serta kesuksesan duniawi dan ukhrawi.</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Adanya kebebasan berpikir dan mengemukakan pendapat yang dijamin oleh aturan yang berlaku.</span></div><div><span style=\"font-size: 13.7078px;\">Dari pernyataan tersebut, dapat disimpulkan yang termasuk Faktor-faktor internal yang mendorong kemajuan peradaban umat Islam adalah…</span></div>', '#_#1_#_1, 2, 3, dan 4#_#2_#_2, 3, 4, dan 5#_#3_#_1, 3, 4, dan 5#_#4_#_1,2,4, dan 5#_#5_#_1, 2, 3 dan 5#_#6_#_#_#', '4'),
(118, 88, '<div><span style=\"font-size: 13.7078px;\">Pada 1979, seorang ilmuwan muslim memenangkan hadiah Nobel. Penemuan terbesar dalam hidupnya ini adalah kunci yang mendasari teori fisika partikel yang masih dipakai hingga kini, partikel ini dikenal sebagai partikel Tuhan, partikel tersebut juga menjadi tonggak penemuan partikel Higgs Boson pada 2012. (www.fisikanet.lipi.go.id)</span></div><div><span style=\"font-size: 13.7078px;\">Urutan nama ilmuwan muslim berdasarkan asal negara dan bidang hadiah Nobel yang dimenangkannya adalah. …</span></div>', '#_#1_#_Muhammad Iqbal - Pakistan - bidang Fisika nuklir#_#2_#_Abdus Salam - Pakistan - bidang Fisika#_#3_#_Al-Hawarizmi - Uzbekistan - Rekayasa Partikel#_#4_#_Baharuddin Jusuf Habibi - Indonesia - Mekanika Pesawat#_#5_#_Salman Khan - India - Termodinamika#_#6_#_#_#', '2'),
(119, 88, '<div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Sebagai salah satu metode penyebaran Agama Islam di Indonesia adalah dengan mengakomodir kebudayaan lokal seperti sastra dan pewayangan atau disebut juga akulturasi budaya. Tujuan dari akulturasi ini diantaranya agar menarik masyarakat dalam memahami dan menjalankan ajaran Islam. Berdasarkan deskripsi tersebut, faktor yang mempengaruhi perkembangan Islam di Indonesia adalah ...</span></font></div>', '#_#1_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Perkawinan</span>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Perdagangan</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Pendidikan</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Tasawuf</span>#_#5_#_<p><span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Kesenian</span><br></p>#_#6_#_#_#', '5'),
(120, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan di bawah ini :</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Perdagangan</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Pernikahan</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Pendidikan</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Kesenian</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Persaudaraan</span></div><div><span style=\"font-size: 13.7078px;\">Strategi masuknya Islam ke Nusantara menggunakan cara damai dan dilakukan dengan cara- cara …</span></div>', '#_#1_#_1, 2, 3 dan 4#_#2_#_1, 2, 3 dan 5#_#3_#_1, 2, 4 dan 5#_#4_#_1, 3, 4 dan 5#_#5_#_2, 3, 4 dan 5#_#6_#_#_#', '1'),
(121, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan-pernyataan berikut:</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Kesadaran umat Islam menggali dan mengembangkan ilmu pengetahuan</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Gerakan penerjemahan buku-buku filsafat ke dalam bahasa Arab</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Terjadinya asimilasi antara bangsa Arab dengan bangsa lainnya</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Didirikannya Baitul Hikmah sebagai pusat penerjemahan</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Pengaruh negatif dari aliran-aliran pemikiran Islam</span></div><div><span style=\"font-size: 13.7078px;\">Dari pernyataan tersebut, dapat disimpulkan yang termasuk faktor-faktor pendukung kejayaan Islam adalah ….</span></div>', '#_#1_#_1), 2), 3) dan 4)#_#2_#_1), 2), 3) dan 5)#_#3_#_1), 2), 4) dan 5)#_#4_#_1), 3), 4) dan 5)#_#5_#_2), 3), 4) dan 5)&nbsp;#_#6_#_#_#', '1'),
(122, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan berikut:</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Menguatnya materialisme</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Gaya hidup bermewah-mewahan</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Tumbuh subur korupsi, kolusi dan nepotisme</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Dekadensi moral</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Gangguan dari orang-orang munafik</span></div><div><span style=\"font-size: 13.7078px;\">Dari pernyataan tersebut, dapat disimpulkan yang termasuk faktor-faktor internal yang mempengaruhi kemunduran peradaban umat Islam ditunjukkan pada nomor …</span></div>', '#_#1_#_1), 2), 3) dan 4)#_#2_#_1), 2), 3) dan 5)#_#3_#_1), 2), 4) dan 5)#_#4_#_1), 3), 4) dan 5)#_#5_#_<div>2), 3), 4) dan 5)</div>#_#6_#_#_#', '2'),
(123, 88, '<div><span style=\"font-size: 13.7078px;\">Perhatikan pernyataan berikut:</span></div><div><span style=\"font-size: 13.7078px;\">1)<span style=\"white-space:pre\">	</span>Akibat berpalingnya dari Al-Quran dan Hadits</span></div><div><span style=\"font-size: 13.7078px;\">2)<span style=\"white-space:pre\">	</span>Taklid buta</span></div><div><span style=\"font-size: 13.7078px;\">3)<span style=\"white-space:pre\">	</span>Perpecahan antar umat Islam</span></div><div><span style=\"font-size: 13.7078px;\">4)<span style=\"white-space:pre\">	</span>Peperangan antara haq dan bathil</span></div><div><span style=\"font-size: 13.7078px;\">5)<span style=\"white-space:pre\">	</span>Perbedaan pandangan atau madzhab</span></div><div><span style=\"font-size: 13.7078px;\">Dari pernyataan tersebut, dapat disimpulkan, faktor-faktor yang mempengaruhi kemunduran umat Islam ditunjukkan pada nomor …</span></div>', '#_#1_#_1), 2), 3) dan 4)#_#2_#_1), 2), 3) dan 5)#_#3_#_1), 2), 4) dan 5)#_#4_#_1), 3), 4) dan 5)#_#5_#_2), 3), 4) dan 5)#_#6_#_#_#', '5'),
(124, 89, '<div><span style=\"font-size: 13.7078px;\">Mr. Brown<span style=\"white-space:pre\">	</span>: Good morning, Mrs. Rowling.&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">Let me introduce my colleague, Mr. Gita Wirjawan.</span></div><div><span style=\"font-size: 13.7078px;\">Mrs. Rowling<span style=\"white-space:pre\">	</span>: ….. I am Rowling.&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">Mr. Wiriawan<span style=\"white-space:pre\">	</span>: How do you do? It\'s nice to meet you.</span></div>', '#_#1_#_Nice to see you, Mr. Wirjawan.&nbsp;#_#2_#_How do you do, Mr. Wirjawan?#_#3_#_Let me introduce myself.&nbsp;#_#4_#_<div>How are you?</div>#_#5_#_#_#6_#_#_#', '2'),
(125, 89, '<div><span style=\"font-size: 13.7078px;\">Bella<span style=\"white-space:pre\">		</span>: Hello, I\'m Bella. Are you a new student here?&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">Fatimah<span style=\"white-space:pre\">	</span>: Yes. I\'m Fatimah. Pleased to meet you, Bella.</span></div><div><span style=\"font-size: 13.7078px;\">Bella<span style=\"white-space:pre\">		</span>: ……………..</span></div>', '#_#1_#_Good.#_#2_#_I am happy, too.&nbsp;#_#3_#_Pleased to meet you, too.#_#4_#_I\'m fine. Thank you.#_#5_#_#_#6_#_#_#', '3'),
(126, 89, '<div><span style=\"font-size: 13.7078px;\">Woman<span style=\"white-space:pre\">		</span>: Are you Bastian, the winner of the swimming competition?</span></div><div><span style=\"font-size: 13.7078px;\">Man<span style=\"white-space:pre\">		</span>: Yes, Miss. I\'m Bastian.</span></div><div><span style=\"font-size: 13.7078px;\">Woman<span style=\"white-space:pre\">		</span>: Please accept my warmest congratulations. I\'m a swimmer from Atlanta Vocational School.</span></div><div><span style=\"font-size: 13.7078px;\">Man<span style=\"white-space:pre\">		</span>: That\'s nice of you for saying so.</span></div><div><span style=\"font-size: 13.7078px;\">What cómpetition does the man win?</span></div>', '#_#1_#_Football competition#_#2_#_Basketball competition#_#3_#_Swimming competition#_#4_#_Badminton competition#_#5_#_#_#6_#_#_#', '3'),
(127, 89, '<div><span style=\"font-size: 13.7078px;\">Man<span style=\"white-space:pre\">		</span>: Hi, Tabitha. My sister said that you won a writing poem competiton last Saturday. By the way, Congratulations for your achievement.&nbsp;</span></div><div><span style=\"font-size: 13.7078px;\">Woman<span style=\"white-space:pre\">		</span>: Thanks, Aldo.</span></div><div><span style=\"font-size: 13.7078px;\">Who is the winner of the writing competition?</span></div>', '#_#1_#_<div>Aldo</div>#_#2_#_Aldo\'s sister#_#3_#_Aldo\'s clasmate#_#4_#_Tabitha#_#5_#_#_#6_#_#_#', '4'),
(128, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left:36.0pt;border-collapse:collapse;border:none;mso-border-alt:\r\n solid windowtext .5pt;mso-yfti-tbllook:1184;mso-padding-alt:0cm 5.4pt 0cm 5.4pt\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;mso-yfti-lastrow:yes\">\r\n  <td width=\"601\" valign=\"top\" style=\"width:450.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoListParagraphCxSpFirst\" align=\"center\" style=\"margin-bottom:0cm;\r\n  mso-add-space:auto;text-align:center;line-height:normal\"><a name=\"_Hlk128559807\"><span lang=\"EN-US\">Coconut Tree<o:p></o:p></span></a></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" align=\"center\" style=\"margin-bottom:0cm;\r\n  mso-add-space:auto;text-align:center;line-height:normal\"><span style=\"mso-bookmark:_Hlk128559807\"><span lang=\"EN-US\"><o:p>&nbsp;</o:p></span></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span style=\"mso-bookmark:_Hlk128559807\"><span lang=\"EN-US\">Coconut\r\n  tree is a tree of the palm family. It is one of trees which lives in tropical\r\n  countries. Coconut tree is tall palm tree bearing coconut as fruit. Cocos\r\n  nucifera is binomial name of its. <o:p></o:p></span></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span style=\"mso-bookmark:_Hlk128559807\"><span lang=\"EN-US\">Coconut\r\n  tree can grow up to 30 meters. They have à single cylindrical trunk. At the\r\n  top of the trunk there are pinnate leaves. They are about 3 to 4 meters long\r\n  and the pinnate 60 to 90 centimeters long. The fruit of coconut tree is\r\n  coconut. It is oval and the diameter is about 30 centimeters long. It has\r\n  thick husk and a hard shell. Inside the shell there is white meat and sweet\r\n  liquid. Coconut tree usually grows in the lowland. It is easy to grow because\r\n  it. does not need special care. Coconut tree can survive until few years.\r\n  Coconut tree is different from other trees because it is multifunction.\r\n  Coconut tree is very useful plant. People use every part of the tree for\r\n  their lives. The white meat can make into copra by drying it. Then the people\r\n  can get oil from it and used it for their daily cooking. Beside copra, the\r\n  meat also can make soap, candles and people use it in culinary. The trunk is\r\n  used to build houses. Sometimes there are people who use the leaves as roof\r\n  and the people in Indonesia usually use them to make \"ketupat\".\r\n  People also can make rope and doormats, from the coconut\'s husk. Because\r\n  coconut tree is very useful, so it is used as scout symbol.<o:p></o:p></span></span></p>\r\n  </td>\r\n  \r\n </tr>\r\n</tbody></table><p>\r\n\r\n\r\n\r\n</p><p class=\"MsoListParagraph\"><span lang=\"EN-US\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;What is the text about?<o:p></o:p></span></p>', '#_#1_#_<div><font face=\"Times New Roman\" size=\"1\">It is about the description of coconut tree.</font></div>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;; font-size: x-small;\">It is about how to plant a coconuttree.&nbsp;</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;; font-size: x-small;\">It is about the legend of coconut tree.</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;; font-size: x-small;\">It is about the news about the coconut\'s price.</span>#_#5_#_#_#6_#_#_#', '1'),
(130, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"553\" valign=\"top\" style=\"width:414.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoListParagraphCxSpFirst\" align=\"center\" style=\"margin-bottom:0cm;\r\n  mso-add-space:auto;text-align:center;line-height:normal\"><span lang=\"EN-US\">Coconut\r\n  Tree<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" align=\"center\" style=\"margin-bottom:0cm;\r\n  mso-add-space:auto;text-align:center;line-height:normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">Coconut tree is a tree of the palm family. It is one\r\n  of trees which lives in tropical countries. Coconut tree is tall palm tree\r\n  bearing coconut as fruit. Cocos nucifera is binomial name of its. <o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">Coconut tree can grow up to 30 meters. They have à\r\n  single cylindrical trunk. At the top of the trunk there are pinnate leaves.\r\n  They are about 3 to 4 meters long and the pinnate 60 to 90 centimeters long.\r\n  The fruit of coconut tree is coconut. It is oval and the diameter is about 30\r\n  centimeters long. It has thick husk and a hard shell. Inside the shell there\r\n  is white meat and sweet liquid. Coconut tree usually grows in the lowland. It\r\n  is easy to grow because it. does not need special care. Coconut tree can\r\n  survive until few years. Coconut tree is different from other trees because\r\n  it is multifunction. Coconut tree is very useful plant. People use every part\r\n  of the tree for their lives. The white meat can make into copra by drying it.\r\n  Then the people can get oil from it and used it for their daily cooking.\r\n  Beside copra, the meat also can make soap, candles and people use it in\r\n  culinary. The trunk is used to build houses. Sometimes there are people who\r\n  use the leaves as roof and the people in Indonesia usually use them to make\r\n  \"ketupat\". People also can make rope and doormats, from the\r\n  coconut\'s husk. Because coconut tree is very useful, so it is used as scout\r\n  symbol.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-indent:36.0pt\"><span lang=\"EN-US\">How is the fruit of coconut tree?&nbsp;<o:p></o:p></span></p>', '#_#1_#_<div>Triangle and the angle is about 15 cm long.&nbsp;</div>#_#2_#_<span style=\"font-size: 12.6889px;\">Round and the diameter is about 10 cm.&nbsp;</span>#_#3_#_<span style=\"font-size: 12.6889px;\">Oval and the diameter is about 300 cm long.</span>#_#4_#_<div>Oval and the diameter is about 30 cm long.&nbsp;</div><div><br style=\"font-size: 12.6889px;\"></div>#_#5_#_#_#6_#_#_#', '4'),
(131, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 54pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"529\" valign=\"top\" style=\"width:396.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><a name=\"_Hlk128560804\"><span lang=\"EN-US\">On Wednesday, my students\r\n  and I went to Yogyakarta. We stayed at Dirgahayu Hotel which not far from\r\n  Malioboro.<o:p></o:p></span></a></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">On Thursday\r\n  we visited the temples in Prambanan. There are three big temples, the Brahmana,\r\n  Syiwa and Wisnu temples. They are really amazing. We visited only Brahma and\r\n  Syiwa temples, because Wisnu temple is being renovated.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">On Friday\r\n  morning we went to Yogya Kraton. We spent about two hours there. We were\r\n  lucky because we were led by a smart and friendly guide. Then we continued\r\n  our journey to Borobudur. We arrived there at four p.m. At 5 p.m. we heard\r\n  and announcement that Borobudur gate would be closed. <o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin:0cm;mso-add-space:auto;text-align:\r\n  justify;line-height:normal\"><span lang=\"EN-US\">In the evening we left for Jakarta by Wisata bus.<o:p></o:p></span></p>\r\n  </td>\r\n  \r\n </tr>\r\n</tbody></table>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:54.0pt\"><span lang=\"EN-US\">The text above mainly discusses about.....&nbsp;<o:p></o:p></span></p>', '#_#1_#_<div>The writer\'s trip to Yogyakarta&nbsp;</div>#_#2_#_<span style=\"font-size: 12.6889px;\">The writer\'s first visit to Prambanan&nbsp;</span>#_#3_#_<span style=\"font-size: 12.6889px;\">The writer\'s impression about the guide</span>#_#4_#_<span style=\"font-size: 12.6889px;\">The writer\'s experience at Yogya Kraton&nbsp;</span>#_#5_#_#_#6_#_#_#', '1'),
(132, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 54pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"529\" valign=\"top\" style=\"width:396.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">On Wednesday, my students and I went to Yogyakarta.\r\n  We stayed at Dirgahayu Hotel which not far from Malioboro.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">On Thursday we visited the temples in Prambanan.\r\n  There are three big temples, the Brahmana, Syiwa and Wisnu temples. They are\r\n  really amazing. We visited only Brahma and Syiwa temples, because Wisnu\r\n  temple is being renovated.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">On Friday morning we went to Yogya Kraton. We spent\r\n  about two hours there. We were lucky because we were led by a smart and\r\n  friendly guide. Then we continued our journey to Borobudur. We arrived there\r\n  at four p.m. At 5 p.m. we heard and announcement that Borobudur gate would be\r\n  closed. <o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin:0cm;mso-add-space:auto;text-align:\r\n  justify;line-height:normal\"><span lang=\"EN-US\">In the evening we left for\r\n  Jakarta by Wisata bus.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:36.0pt;text-indent:18.0pt\"><span lang=\"EN-US\">The text is written in\r\nthe form of a/an ……<o:p></o:p></span></p>', '#_#1_#_<div>Narrative</div>#_#2_#_<span style=\"font-size: 12.6889px;\">Anecdote</span>#_#3_#_<span style=\"font-size: 12.6889px;\">Report</span>#_#4_#_<span style=\"font-size: 12.6889px;\">Recount</span>#_#5_#_#_#6_#_#_#', '4'),
(133, 89, '<p>&nbsp;&nbsp;&nbsp;&nbsp;\r\n </p><p></p><p></p><table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\"><tbody><tr>\r\n  <td width=\"553\" valign=\"top\" style=\"width:414.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n  36.0pt;line-height:normal\"><a name=\"_Hlk128561420\"><span lang=\"EN-US\">Once upon\r\n  a time, a farmer had three sons. The farmer was rich and had many fields. When\r\n  the farmer was dying, he called his three sons to him. \"I have left you\r\n  treasure which will make you rich,\" he told them. \"But you must dig\r\n  in all our fields to find the place where the treasure was buried.\"<o:p></o:p></span></a></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n  36.0pt;line-height:normal\"><span lang=\"EN-US\">After the old man died, his three lazy sons went out into the\r\n  fields. They began to dig. \"I\'ll dig the first to find the place where\r\n  the treasure was buried,\" cried the eldest one. \"That\'s the field\r\n  where our father put the treasure,\" said another son. The three sons dug\r\n  all the fields for several years, but they found no treasure. However, many\r\n  plants grew in the fields because the sons had dug. The vegetables made them\r\n  very rich.<o:p></o:p></span></p>\r\n  </td>\r\n  \r\n </tr>\r\n</tbody><tbody></tbody></table><span style=\"font-size: 12.6889px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;What did the farmer leave for his sons?</span><br style=\"font-size: 12.6889px;\">', '#_#1_#_<div>Treasure</div>#_#2_#_<span style=\"font-size: 12.6889px;\">A place</span>#_#3_#_<span style=\"font-size: 12.6889px;\">Gold</span>#_#4_#_<div>Money</div>#_#5_#_#_#6_#_#_#', '1'),
(134, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"553\" valign=\"top\" style=\"width:414.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n  36.0pt;line-height:normal\"><span lang=\"EN-US\">Once upon a time, a farmer had\r\n  three sons. The farmer was rich and had many fields. When the farmer was\r\n  dying, he called his three sons to him. \"I have left you treasure which\r\n  will make you rich,\" he told them. \"But you must dig in all our\r\n  fields to find the place where the treasure was buried.\"<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;text-indent:\r\n  36.0pt;line-height:normal\"><span lang=\"EN-US\">After the old man died, his three\r\n  lazy sons went out into the fields. They began to dig. \"I\'ll dig the\r\n  first to find the place where the treasure was buried,\" cried the eldest\r\n  one. \"That\'s the field where our father put the treasure,\" said\r\n  another son. The three sons dug all the fields for several years, but they\r\n  found no treasure. However, many plants grew in the fields because the sons\r\n  had dug. The vegetables made them very rich.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-indent:36.0pt\"><span lang=\"EN-US\">What had to the three sons do to find the treasure?&nbsp;<o:p></o:p></span></p>', '#_#1_#_<div>Destroying all fields</div>#_#2_#_<span style=\"font-size: 12.6889px;\">Digging in all the fields</span>#_#3_#_<span style=\"font-size: 12.6889px;\">Asking all people to help them</span>#_#4_#_<span style=\"font-size: 12.6889px;\">Selling the fields to other people</span>#_#5_#_#_#6_#_#_#', '2');
