(137, 89, '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1\"><font face=\"Times New Roman\" size=\"1\"><span style=\"text-indent: -18pt;\">C</span></font><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: calc(12px + 2 * ((100vw - 600px) / 540));\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">   </span></span><span lang=\"EN-US\" style=\"text-indent: -18pt; font-size: calc(12px + 2 * ((100vw - 600px) / 540));\">Cally       : It’s been a very hectic month, hasn’t it?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto\"><span lang=\"EN-US\">Kinan     : Yeah,\r\nsure. I have to study online with an abundant assignment.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto\"><span lang=\"EN-US\">Cally       : I’m\r\nthinking about going to the beach for swimming this holiday.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto\"><span lang=\"EN-US\">Kinan     : I don’t\r\nthink it’s a good idea. I heard that the sea condition nowadays is at risk of\r\ndisaster. (a)</span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">____________</span><span style=\"font-size: calc(12px + 2 * ((100vw - 600px) / 540));\"> a village instead?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto\"><span lang=\"EN-US\">Cally       : You\r\nare right. Which village should we visit?<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto\"><span lang=\"EN-US\">Kinan     : How\r\nabout my grandmother’s village in Lembang? We can visit a lot of tourist spots\r\nthere.<o:p></o:p></span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-bottom:0cm;mso-add-space:\r\nauto\"><span lang=\"EN-US\">Cally       : (b) <font face=\"Calibri, sans-serif\"><span style=\"font-size: 14.6667px;\"> </span></font></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">____________</span><span style=\"font-size: calc(12px + 2 * ((100vw - 600px) / 540));\">. When will we go there?</span></p>\r\n\r\n<p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0cm;mso-add-space:auto\"><span lang=\"EN-US\">Kinan     : You have to be at\r\nmy home tomorrow. </span></p><p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0cm;mso-add-space:auto\"><span lang=\"EN-US\"><o:p><br></o:p></span></p><p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntab-stops:183.8pt\">The most suitable expression to complete the sentence (a) is ……………….</p>', '#_#1_#_<span style=\"font-size: 12.6889px;\">May I offer you an idea? </span>#_#2_#_<span style=\"font-size: 12.6889px;\">What do you suggest?</span>#_#3_#_<span style=\"font-size: 12.6889px;\">How about</span>#_#4_#_<span style=\"font-size: 12.6889px;\">Maybe you should</span>#_#5_#_#_#6_#_#_#', '3'),
(138, 89, '<div>Cally<span style=\"white-space:pre\">	</span>: It’s been a very hectic month, hasn’t it?</div><div>Kinan<span style=\"white-space:pre\">	</span>: Yeah, sure. I have to study online with an abundant assignment.</div><div>Cally<span style=\"white-space:pre\">	</span>: I’m thinking about going to the beach for swimming this holiday.</div><div>Kinan<span style=\"white-space:pre\">	</span>: I don’t think it’s a good idea. I heard that the sea condition nowadays is at risk of disaster. (a)&nbsp;<span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">________</span><span style=\"font-size: calc(12px + 2 * ((100vw - 600px) / 540));\">&nbsp;a village instead?</span></div><div>Cally<span style=\"white-space:pre\">	</span>: You are right. Which village should we visit?</div><div>Kinan<span style=\"white-space:pre\">	</span>: How about my grandmother’s village in Lembang? We can visit a lot of tourist spots there.</div><div>Cally<span style=\"white-space:pre\">	</span>: (b)&nbsp;<span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">________</span><span style=\"font-size: calc(12px + 2 * ((100vw - 600px) / 540));\">. When will we go there?</span></div><div>Kinan<span style=\"white-space:pre\">	</span>: You have to be at my home tomorrow.&nbsp;</div><div><br></div><div>The best response stated by Cally (b) is ……………</div>', '#_#1_#_<span style=\"font-size: 12.6889px;\">Let’s try that.</span>#_#2_#_<span style=\"font-size: 12.6889px;\">That’s a great idea.</span>#_#3_#_<span style=\"font-size: 12.6889px;\">I’m not really sure</span>#_#4_#_<span style=\"font-size: 12.6889px;\">No, thanks.</span>#_#5_#_#_#6_#_#_#', '2'),
(139, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"601\" valign=\"top\" style=\"width:450.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">Junk food comes from factories, containing ketchup,\r\n  oils, salts, sugars, and fats. The factories pollute the air, which may hurt\r\n  our lungs. This food makes us fat and lazy. Not only humans suffer from junk\r\n  food, but also planet Earth because the factories may kill animals and cut\r\n  trees to support their business. With these dangers in front of you, will you\r\n  still eat junk food? in my opinion, you should stop eating junk food for a\r\n  better future.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-indent:36.0pt\"><span lang=\"EN-US\">What is the author\'s opinion about junk food?<o:p></o:p></span></p>', '#_#1_#_<div>It is delicious.</div>#_#2_#_<span style=\"font-size: 12.6889px;\">It is hazardous.</span>#_#3_#_<span style=\"font-size: 12.6889px;\">It comes from factories.</span>#_#4_#_<span style=\"font-size: 12.6889px;\">It is good for people\'s health</span>#_#5_#_#_#6_#_#_#', '2'),
(140, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"601\" valign=\"top\" style=\"width:450.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoListParagraph\" style=\"margin:0cm;mso-add-space:auto;text-align:\r\n  justify;line-height:normal\"><span lang=\"EN-US\">Junk food comes from factories,\r\n  containing ketchup, oils, salts, sugars, and fats. The factories pollute the\r\n  air, which may hurt our lungs. This food makes us fat and lazy. Not only\r\n  humans suffer from junk food, but also planet Earth because the factories may\r\n  kill animals and cut trees to support their business. With these dangers in\r\n  front of you, will you still eat junk food? in my opinion, you should stop\r\n  eating junk food for a better future.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-indent:36.0pt\"><span lang=\"EN-US\">What is the purpose of the text?<o:p></o:p></span></p>', '#_#1_#_<div>To give reasons for people to stop consuming junk food.</div>#_#2_#_<span style=\"font-size: 12.6889px;\">To persuade junk food consumers.</span>#_#3_#_<span style=\"font-size: 12.6889px;\">To give the benefit of junk food.</span>#_#4_#_<p><span style=\"font-size: 12.6889px;\">To advertise junk food.</span><br></p>#_#5_#_#_#6_#_#_#', '1'),
(141, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"601\" valign=\"top\" style=\"width:450.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoListParagraph\" style=\"margin:0cm;mso-add-space:auto;text-align:\r\n  justify;line-height:normal\"><span lang=\"EN-US\">I\'m a Korean Pop (K-Pop) fan. I\r\n  think K-Pop is just another kind of music. I think everybody\'s got their\r\n  views. I like it because I feel energetic and inspired by most of the lyrics.\r\n  I agree that some fans can be very negative by disturbing their artists\'\r\n  private life and bashing them instantly. Therefore, I disagree with this kind\r\n  of behavior.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-indent:36.0pt\"><span lang=\"EN-US\">What does the author say about K-Pop?<o:p></o:p></span></p>', '#_#1_#_<div>It is energetic and inspiring.</div>#_#2_#_<span style=\"font-size: 12.6889px;\">She/he is not a fan.</span>#_#3_#_<span style=\"font-size: 12.6889px;\">The lyrics are boring.</span>#_#4_#_<span style=\"font-size: 12.6889px;\">She/he loves all types of music.</span>#_#5_#_#_#6_#_#_#', '1'),
(142, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"601\" valign=\"top\" style=\"width:450.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoListParagraph\" style=\"margin:0cm;mso-add-space:auto;text-align:\r\n  justify;line-height:normal\"><span lang=\"EN-US\">I\'m a Korean Pop (K-Pop) fan. I\r\n  think K-Pop is just another kind of music. I think everybody\'s got their\r\n  views. I like it because I feel energetic and inspired by most of the lyrics.\r\n  I agree that some fans can be very negative by disturbing their artists\'\r\n  private life and bashing them instantly. Therefore, I disagree with this kind\r\n  of behavior.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-indent:36.0pt\"><span lang=\"EN-US\">What she does not like about K-Pop?<o:p></o:p></span></p>', '#_#1_#_<div>The members are attractive. </div>#_#2_#_<span style=\"font-size: 12.6889px;\">The fans can be toxic sometimes. </span>#_#3_#_<span style=\"font-size: 12.6889px;\">People can have their opinions.</span>#_#4_#_<span style=\"font-size: 12.6889px;\">The music is overrated.</span>#_#5_#_#_#6_#_#_#', '2'),
(143, 89, '<div align=\"center\">\r\n\r\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\">\r\n <tbody><tr>\r\n  <td width=\"510\" valign=\"top\" style=\"width:382.25pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">Microwaves are high-frequency electromagnetic\r\n  waves, the energy released enabling food to be cooked or reheated without\r\n  changing either the form or the color. You can use your microwave oven to:<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:7.65pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-7.65pt;line-height:normal;mso-list:l3 level1 lfo1;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;\r\n  mso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Defrost<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:7.65pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-7.65pt;line-height:normal;mso-list:l3 level1 lfo1;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;\r\n  mso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Reheat<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:7.65pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-7.65pt;line-height:normal;mso-list:l3 level1 lfo1;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;\r\n  mso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Cook<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><b><span lang=\"EN-US\">COOKING PRINCIPLE<o:p></o:p></span></b></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-12.15pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\">The microwaves generated by the magnetron and are distributed\r\n  uniformly as the food rotates on the turntable. The food is thus cooked\r\n  evenly. <o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-12.15pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\">The microwaves are absorbed by the food up to a depth of about 1\r\n  inch (2.5cm). Cooking then continues as the heat is dissipated within the\r\n  food.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-12.15pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\">Cooking times vary according to the container used and the\r\n  properties of the food.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l1 level1 lfo3;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Quantity and density<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l1 level1 lfo3;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Water content<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l1 level1 lfo3;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Initial temperature (refrigerated or not)<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><b><span lang=\"EN-US\">IMPORTANT<o:p></o:p></span></b></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">As the center of the food is\r\n  cooked by heat dissipation, cooking continues even when you have taken the food\r\n  out of the oven, Standing times specified in recipes and in this booklet must\r\n  therefore be observed to ensure:<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l0 level1 lfo4;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Even cooking of the food right to the center. <o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l0 level1 lfo4;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">The same temperature throughout the food.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table></div><div align=\"center\"><table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\"><tbody><tbody>What is the mechanism of a microwave?&nbsp;</tbody><tbody></tbody><tbody></tbody><tbody></tbody><tbody></tbody><tbody></tbody></tbody></table></div><div align=\"center\"><table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\"><tbody><br></tbody></table></div><div align=\"center\"><table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\"><tbody><br></tbody></table><br></div><div align=\"center\"></div>', '#_#1_#_It employs electromagnetic waves.&nbsp;<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"background-color: rgb(255, 255, 255); width: 529px; font-size: 12.6889px; border: none;\"><tbody></tbody><tbody></tbody></table>#_#2_#_It doesn\'t change the form of the food.<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"background-color: rgb(255, 255, 255); width: 529px; font-size: 12.6889px; border: none;\"><tbody></tbody><tbody></tbody></table>#_#3_#_It rotates the food containers.<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"background-color: rgb(255, 255, 255); width: 529px; font-size: 12.6889px; border: none;\"><tbody></tbody><tbody></tbody></table>#_#4_#_It varies the cooking timing.<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"background-color: rgb(255, 255, 255); width: 529px; font-size: 12.6889px; border: none;\"><tbody></tbody><tbody></tbody></table>#_#5_#_#_#6_#_#_#', '1'),
(144, 89, '<div align=\"center\">\r\n\r\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\">\r\n <tbody><tr>\r\n  <td width=\"510\" valign=\"top\" style=\"width:382.25pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">Microwaves are high-frequency\r\n  electromagnetic waves, the energy released enabling food to be cooked or\r\n  reheated without changing either the form or the color. You can use your\r\n  microwave oven to:<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:7.65pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-7.65pt;line-height:normal;mso-list:l3 level1 lfo1;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;\r\n  mso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Defrost<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:7.65pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-7.65pt;line-height:normal;mso-list:l3 level1 lfo1;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;\r\n  mso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; f