 normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\">The microwaves generated by the magnetron and are distributed\r\n  uniformly as the food rotates on the turntable. The food is thus cooked\r\n  evenly. <o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-12.15pt;line-height:normal;mso-list:l1 level1 lfo4;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\">The microwaves are absorbed by the food up to a depth of about 1\r\n  inch (2.5cm). Cooking then continues as the heat is dissipated within the\r\n  food.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-12.15pt;line-height:normal;mso-list:l1 level1 lfo4;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp; </span></span><!--[endif]--><span lang=\"EN-US\">Cooking times vary according to the container used and the\r\n  properties of the food.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Quantity and density<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Water content<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Initial temperature (refrigerated or not)<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><b><span lang=\"EN-US\">IMPORTANT<o:p></o:p></span></b></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">As the center of the food is\r\n  cooked by heat dissipation, cooking continues even when you have taken the\r\n  food out of the oven, Standing times specified in recipes and in this booklet\r\n  must therefore be observed to ensure:<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l0 level1 lfo3;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Even cooking of the food right to the center. <o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l0 level1 lfo3;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">The same temperature throughout the food.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div>\r\n\r\n<span lang=\"EN-US\" style=\"font-size:11.0pt;line-height:107%;font-family:&quot;Calibri&quot;,sans-serif;\r\nmso-ascii-theme-font:minor-latin;mso-fareast-font-family:Calibri;mso-fareast-theme-font:\r\nminor-latin;mso-hansi-theme-font:minor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;\r\nmso-bidi-theme-font:minor-bidi;mso-ansi-language:EN-US;mso-fareast-language:\r\nEN-US;mso-bidi-language:AR-SA;mso-no-proof:yes\">\"The food is thus cooked\r\nevenly.\" (Cooking Principle 1) The word \'evenly\' in the manual has the\r\nsame meaning as ……</span>', '#_#1_#_<div>Enormously</div>#_#2_#_<span style=\"font-size: 12.6889px;\">Eventually</span>#_#3_#_<span style=\"font-size: 12.6889px;\">Equally</span>#_#4_#_<span style=\"font-size: 12.6889px;\">Easily</span>#_#5_#_#_#6_#_#_#', '3'),
