rmal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;\r\n  </span></span><!--[endif]--><span lang=\"EN-US\">The microwaves generated by\r\n  the magnetron and are distributed uniformly as the food rotates on the\r\n  turntable. The food is thus cooked evenly. <o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-indent:-12.15pt;\r\n  line-height:normal;mso-list:l1 level1 lfo4;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;\r\n  </span></span><!--[endif]--><span lang=\"EN-US\">The microwaves are absorbed\r\n  by the food up to a depth of about 1 inch (2.5cm). Cooking then continues as\r\n  the heat is dissipated within the food.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-indent:-12.15pt;\r\n  line-height:normal;mso-list:l1 level1 lfo4;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;\r\n  </span></span><!--[endif]--><span lang=\"EN-US\">Cooking times vary according\r\n  to the container used and the properties of the food.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Quantity and density<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Water content<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Initial temperature (refrigerated or not)<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><b><span lang=\"EN-US\">IMPORTANT<o:p></o:p></span></b></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">As the center of the food is\r\n  cooked by heat dissipation, cooking continues even when you have taken the\r\n  food out of the oven, Standing times specified in recipes and in this booklet\r\n  must therefore be observed to ensure:<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l0 level1 lfo3;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Even cooking of the food right to the center. <o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l0 level1 lfo3;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">The same temperature throughout the food.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:36.0pt;tab-stops:183.8pt\"><span lang=\"EN-US\">What is the important\r\nthing to be noticed?<o:p></o:p></span></p>', '#_#1_#_<div>The time taken between taking out the food and consuming it.&nbsp;</div>#_#2_#_<span style=\"font-size: 12.6889px;\">The specification of the ingredients in the recipe book.&nbsp;</span>#_#3_#_<span style=\"font-size: 12.6889px;\">The provided booklet must be put near the microwave.&nbsp;</span>#_#4_#_<span style=\"font-size: 12.6889px;\">The location where you put the food and its temperature.&nbsp;</span>#_#5_#_#_#6_#_#_#', '4'),
(147, 89, '<div align=\"center\">\r\n\r\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"border: none;\">\r\n <tbody><tr>\r\n  <td width=\"510\" valign=\"top\" style=\"width:382.25pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">Microwaves are high-frequency\r\n  electromagnetic waves, the energy released enabling food to be cooked or\r\n  reheated without changing either the form or the color. You can use your\r\n  microwave oven to:<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:7.65pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-7.65pt;line-height:normal;mso-list:l3 level1 lfo1;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;\r\n  mso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Defrost<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:7.65pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-7.65pt;line-height:normal;mso-list:l3 level1 lfo1;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;\r\n  mso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Reheat<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:7.65pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-7.65pt;line-height:normal;mso-list:l3 level1 lfo1;tab-stops:\r\n  183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;\r\n  mso-fareast-font-family:Wingdings;mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Cook<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><b><span lang=\"EN-US\">COOKING PRINCIPLE<o:p></o:p></span></b></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-indent:-12.15pt;\r\n  line-height:normal;mso-list:l1 level1 lfo4;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;\r\n  </span></span><!--[endif]--><span lang=\"EN-US\">The microwaves generated by\r\n  the magnetron and are distributed uniformly as the food rotates on the\r\n  turntable. The food is thus cooked evenly. <o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-indent:-12.15pt;\r\n  line-height:normal;mso-list:l1 level1 lfo4;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">2.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;\r\n  </span></span><!--[endif]--><span lang=\"EN-US\">The microwaves are absorbed\r\n  by the food up to a depth of about 1 inch (2.5cm). Cooking then continues as\r\n  the heat is dissipated within the food.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-indent:-12.15pt;\r\n  line-height:normal;mso-list:l1 level1 lfo4;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\">3.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;\r\n  </span></span><!--[endif]--><span lang=\"EN-US\">Cooking times vary according\r\n  to the container used and the properties of the food.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Quantity and density<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Water content<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:21.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l2 level1 lfo2;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Initial temperature (refrigerated or not)<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><b><span lang=\"EN-US\">IMPORTANT<o:p></o:p></span></b></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">As the center of the food is\r\n  cooked by heat dissipation, cooking continues even when you have taken the\r\n  food out of the oven, Standing times specified in recipes and in this booklet\r\n  must therefore be observed to ensure:<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l0 level1 lfo3;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">Even cooking of the food right to the center. <o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:12.15pt;mso-add-space:auto;text-align:justify;\r\n  text-indent:-9.0pt;line-height:normal;mso-list:l0 level1 lfo3;tab-stops:183.8pt\"><!--[if !supportLists]--><span lang=\"EN-US\" style=\"font-family:Wingdings;mso-fareast-font-family:Wingdings;\r\n  mso-bidi-font-family:Wingdings\">§<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\"> </span></span><!--[endif]--><span lang=\"EN-US\">The same temperature throughout the food.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:36.0pt;tab-stops:183.8pt\"><span lang=\"EN-US\">What kind of text is it?<o:p></o:p></span></p>', '#_#1_#_<div>Descriptive text</div>#_#2_#_<span style=\"font-size: 12.6889px;\">Procedural text</span>#_#3_#_<span style=\"font-size: 12.6889px;\">Menu</span>#_#4_#_<span style=\"font-size: 12.6889px;\">Advertisement</span>#_#5_#_#_#6_#_#_#', '2'),
(148, 89, '<div>\"We need to remodel our school-building.\" The passive of the above sentence is \"Our school-building ……………. “.</div>', '#_#1_#_<span style=\"font-size: 12.6889px;\">Needs to be remodeled</span>#_#2_#_<span style=\"font-size: 12.6889px;\">Is needed to remodel</span>#_#3_#_<span style=\"font-size: 12.6889px;\">Needed to remodel</span>#_#4_#_<div>Needing to be remodeled</div>#_#5_#_#_#6_#_#_#', '2'),
(149, 89, '<div>\"Titi is sweeping the floor\" means ………..</div>', '#_#1_#_<span style=\"font-size: 12.6889px;\">The floor was swept</span>#_#2_#_<span style=\"font-size: 12.6889px;\">The floor is being swept</span>#_#3_#_<span style=\"font-size: 12.6889px;\">The floor has swept</span>#_#4_#_<span style=\"font-size: 12.6889px;\">The floor was being swept</span>#_#5_#_#_#6_#_#_#', '2'),
(150, 89, '<div>These generators consisted of mirrors that could be moved and could thus concentrate a large amount of radiation from the sun on blackened pipes through which water was circulated. In this way, the water was turned to steam. Even ice&nbsp;<span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">______</span><span style=\"font-size: calc(12px + 2 * ((100vw - 600px) / 540));\">&nbsp;by a similar method a hundred years ago in Paris.&nbsp;</span></div>', '#_#1_#_<span style=\"font-size: 12.6889px;\">Produced</span>#_#2_#_<span style=\"font-size: 12.6889px;\">Was produced</span>#_#3_#_<p><span style=\"font-size: 12.6889px;\">It produces</span><br></p>#_#4_#_<span style=\"font-size: 12.6889px;\">Were produced</span>#_#5_#_#_#6_#_#_#', '4'),
(151, 89, '<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntext-indent:-18.0pt;mso-list:l0 level1 lfo1;tab-stops:49.5pt 94.5pt\"><!--[if !supportLists]--><span lang=\"EN-US\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n</span></span><!--[endif]--><span lang=\"EN-US\">&nbsp;</span></p>\r\n\r\n<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"601\" valign=\"top\" style=\"width:450.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoListParagraphCxSpMiddle\" align=\"center\" style=\"margin-bottom:0cm;\r\n  mso-add-space:auto;text-align:center;line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Reading is a Good Habit<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" align=\"center\" style=\"margin-bottom:0cm;\r\n  mso-add-space:auto;text-align:center;line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Reading interest\r\n  in Indonesia is very low. On the contrary, a market research agency,\r\n  e-marketer, estimated there were 112 million internet users in Indonesia in\r\n  2017. This condition certainly needs serious attention. We need to build a\r\n  good reading habit.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Books help you\r\n  see a lot of new things in the world. They help you understand various topics\r\n  so you can learn a lot while reading.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Reading a lot of\r\n  books develops your mental health. It helps you develop your imagination and\r\n  creativity when you picture what you need.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">You can improve\r\n  your vocabulary by reading a lot of books. You’ll learn how to communicate\r\n  your ideas in a lot of different ways.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Thus, we can\r\n  conclude that reading is a good habit.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoListParagraph\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; What is the communicative purpose of\r\nthe text?<o:p></o:p></span></p>', '#_#1_#_<p><span style=\"font-size: 12.6889px;\">To tell the readers how to read well.</span><br></p>#_#2_#_<span style=\"font-size: 12.6889px;\">To describe various books to the readers.</span><br>#_#3_#_<span style=\"font-size: 12.6889px;\">To persuade the readers to build reading habits</span><br>#_#4_#_<span style=\"font-size: 12.6889px;\">&nbsp;</span><span style=\"font-size: calc(12px + 2 * ((100vw - 600px) / 540));\">To persuade the readers to reduce the use of internet.</span><div><br style=\"font-size: 12.6889px;\"></div>#_#5_#_#_#6_#_#_#', '3'),
(152, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"553\" valign=\"top\" style=\"width:414.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoListParagraphCxSpFirst\" align=\"center\" style=\"margin-bottom:0cm;\r\n  mso-add-space:auto;text-align:center;line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Reading is a Good Habit<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" align=\"center\" style=\"margin-bottom:0cm;\r\n  mso-add-space:auto;text-align:center;line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Reading interest\r\n  in Indonesia is very low. On the contrary, a market research agency,\r\n  e-marketer, estimated there were 112 million internet users in Indonesia in\r\n  2017. This condition certainly needs serious attention. We need to build a\r\n  good reading habit.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Books help you\r\n  see a lot of new things in the world. They help you understand various topics\r\n  so you can learn a lot while reading.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Reading a lot of\r\n  books develops your mental health. It helps you develop your imagination and\r\n  creativity when you picture what you need.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">You can improve\r\n  your vocabulary by reading a lot of books. You’ll learn how to communicate\r\n  your ideas in a lot of different ways.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpMiddle\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-top:0cm;margin-right:0cm;\r\n  margin-bottom:0cm;margin-left:-1.45pt;mso-add-space:auto;text-align:justify;\r\n  line-height:normal;tab-stops:49.5pt 94.5pt\"><span lang=\"EN-US\">Thus, we can\r\n  conclude that reading is a good habit.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoListParagraph\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntab-stops:76.5pt\"><span lang=\"EN-US\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;From the text we can infer that ……….<o:p></o:p></span></p>', '#_#1_#_<p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\ntab-stops:49.5pt\"><span lang=\"EN-US\">Indonesian people have a good reading habit.</span></p>#_#2_#_<span style=\"font-size: 12.6889px;\">&nbsp;</span><span style=\"font-size: 12.6889px;\">Buying new books helps improve your reading habit.</span>#_#3_#_<span style=\"font-size: 12.6889px;\">The reading interest in Indonesia is higher than the use of internet.</span>#_#4_#_<p><span style=\"font-size: 12.6889px;\">The reading interest in Indonesia needs serious help.</span><br></p>#_#5_#_#_#6_#_#_#', '2'),
(153, 89, '<div>Man<span style=\"white-space:pre\">	</span>: Why can\'t the television be switched on?</div><div>Woman<span style=\"white-space:pre\">	</span>: Because It was dropped some rain water yesterday, the television is off.</div><div>Man<span style=\"white-space:pre\">	</span>: Why didn\'t you call a technician?</div><div>Woman: I called him but he couldn\'t come for he got a toothache.</div><div>Who was called by the woman to repair her television?</div>', '#_#1_#_<span style=\"font-size: 12.6889px;\">A policeman</span>#_#2_#_<span style=\"font-size: 12.6889px;\">A doctor</span>#_#3_#_<span style=\"font-size: 12.6889px;\">A technician</span>#_#4_#_<span style=\"font-size: 12.6889px;\">An architect</span>#_#5_#_#_#6_#_#_#', '3'),
(154, 89, '<div>Man<span style=\"white-space:pre\">	</span>: Do you need some plastic&nbsp; bags again, girl?</div><div>Woman: No, Sir.&nbsp;</div><div>Man<span style=\"white-space:pre\">	</span>: Are you sure? There are some customers who need more plastic bag?</div><div>Woman: Yes, Sir. I reduce the use of plastic bag for the global warming\'s effect is too dangerous.</div><div>Man<span style=\"white-space:pre\">	</span>: Great</div><div>Why does the girl reduce the use the plastic bag?</div>', '#_#1_#_<span style=\"font-size: 12.6889px;\">She thinks about others people.</span>#_#2_#_<span style=\"font-size: 12.6889px;\">She knows the plastic bag is expensive.</span>#_#3_#_<span style=\"font-size: 12.6889px;\">She knows the global warming\'s effect is too dangerous.</span>#_#4_#_<span style=\"font-size: 12.6889px;\">She brings a plastic bag from home.</span>#_#5_#_#_#6_#_#_#', '3'),
(155, 89, '<div>A<span style=\"white-space:pre\">	</span>: What is going to happen to the children who have become orphans due to the tsunami disasters?</div><div>B<span style=\"white-space:pre\">	</span>: Don’t worry, they&nbsp;<span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">_________</span></div>', '#_#1_#_<span style=\"font-size: 12.6889px;\">Will be taken care of&nbsp;</span>#_#2_#_<span style=\"font-size: 12.6889px;\">We’re being taken of</span>#_#3_#_<span style=\"font-size: 12.6889px;\">Should have taken of</span>#_#4_#_<span style=\"font-size: 12.6889px;\">Must take care of</span>#_#5_#_#_#6_#_#_#', '1'),
(156, 89, '<div>Doctors believe some bacteria are more resistant nowadays ................... the misuse of antibiotics</div>', '#_#1_#_<span style=\"font-size: 12.6889px;\">Because</span>#_#2_#_<span style=\"font-size: 12.6889px;\">Because of</span>#_#3_#_<span style=\"font-size: 12.6889px;\">Consequently</span>#_#4_#_<span style=\"font-size: 12.6889px;\">So</span>#_#5_#_#_#6_#_#_#', '2'),
(157, 89, '<div>Derry<span style=\"white-space:pre\">	</span>: Why do you always run around the stadium five times a day?</div><div>Soni<span style=\"white-space:pre\">	</span>: I do it .................</div><div>Which of the following is NOT suitable to complete the dialogue?</div><div><br></div>', '#_#1_#_<span style=\"font-size: 12.6889px; text-indent: -24px;\">However very tired I am</span>#_#2_#_<span style=\"font-size: 12.6889px; text-indent: -24px;\">So that I can reduce my weight</span>#_#3_#_<span style=\"font-size: 12.6889px; text-indent: -24px;\">In order that my body gets stronger</span>#_#4_#_<span style=\"font-size: 12.6889px; text-indent: -24px;\">Because I don’t want to be overweight</span>#_#5_#_#_#6_#_#_#', '1'),
(158, 89, '<div><span style=\"font-size: 13.4074px;\">Waitress<span style=\"white-space:pre\">	</span>: Would you like a cup of tea?</span></div><div><span style=\"font-size: 13.4074px;\">Customer<span style=\"white-space:pre\">	</span>: ..... I love tea. It\'s good for our health.</span></div>', '#_#1_#_No, thanks.#_#2_#_I\'m sorry.#_#3_#_I don\'t think so.#_#4_#_Sure.#_#5_#_#_#6_#_#_#', '4'),
(159, 89, '<div><span style=\"font-size: 13.4074px;\">Irga<span style=\"white-space:pre\">	</span>: Mom, do you mind if I help you cook?</span></div><div><span style=\"font-size: 13.4074px;\">Mother: Of course not. Come and help me.</span></div><div><span style=\"font-size: 13.4074px;\">From the conversation above we know that …….</span></div>', '#_#1_#_Mother doesn\'t like Irga to help her cook.&nbsp;#_#2_#_Irga asked her mother to help her cook.#_#3_#_Irga doesn\'t like cooking.#_#4_#_Mother accepted Irga\'s offer to help her cook.#_#5_#_#_#6_#_#_#', '4'),
(160, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"510\" style=\"width: 382.5pt; margin-left: 58.25pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"510\" valign=\"top\" style=\"width:382.5pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><a name=\"_Hlk129081107\"><span lang=\"EN-US\">To&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Russ Lehman\r\n  &lt;rlehman@lvh.org&gt; <o:p></o:p></span></a></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">From&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Josh Tobin\r\n  &lt;jtobin@hello.com&gt;<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Date&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : May 17th, 2018 :\r\n  Volunteering<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Re&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Volunteering<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Attachments&nbsp; : Application, Recommendation letter<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\n  line-height:normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Dear Mr. Lehman,<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\n  line-height:normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">My name is\r\n  Josh Tobin. Two weeks ago I saw the announcement for the volunteer positions\r\n  posted in the weekly community newsletter.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">I apologize\r\n  for the delay in contacting you. I understand that the completed application\r\n  was due two days ago; however, I have been out of town on vacation. I will\r\n  return on May 21 and will be able to attend the orientation. Please note that\r\n  all necessary documents are attached.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">My time\r\n  this summer is limited, but I\'ll be available every Tuesday. Unfortunately,\r\n  I\'m not available on Saturdays and Sundays due to my restaurant job. I\'ll\r\n  wait to hear from you prior to the orientation and training next week.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\n  line-height:normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Thank you for your time,<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0cm;mso-add-space:\r\n  auto;line-height:normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin:0cm;mso-add-space:auto;\r\n  line-height:normal\"><span lang=\"EN-US\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Josh<o:p></o:p></span></p>\r\n  </td>\r\n  \r\n </tr>\r\n</tbody></table>\r\n\r\n\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:36.0pt;text-indent:18.0pt\"><span lang=\"EN-US\">What does Josh request\r\nin his message?&nbsp;<o:p></o:p></span></p>', '#_#1_#_<div><span style=\"font-size: 13.4074px;\">More time to obtain a recommendation letter</span></div>#_#2_#_A specific shift in the hospital restaurant.&nbsp;#_#3_#_Permission to miss the orientation and training.&nbsp;#_#4_#_Special consideration for his late application#_#5_#_#_#6_#_#_#', '4'),
(161, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" width=\"510\" style=\"width: 382.5pt; margin-left: 58.25pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"510\" valign=\"top\" style=\"width:382.5pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">To&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Russ\r\n  Lehman <rlehman@lvh.org> <o:p></o:p></rlehman@lvh.org></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">From&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Josh\r\n  Tobin <jtobin@hello.com><o:p></o:p></jtobin@hello.com></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Date&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : May\r\n  17th, 2018 : Volunteering<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Re&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : Volunteering<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Attachments&nbsp; : Application,\r\n  Recommendation letter<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\n  line-height:normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Dear Mr. Lehman,<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\n  line-height:normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">My name is Josh Tobin. Two weeks ago I saw the\r\n  announcement for the volunteer positions posted in the weekly community\r\n  newsletter.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">I apologize for the delay in contacting you. I\r\n  understand that the completed application was due two days ago; however, I\r\n  have been out of town on vacation. I will return on May 21 and will be able\r\n  to attend the orientation. Please note that all necessary documents are\r\n  attached.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal\"><span lang=\"EN-US\">My time this summer is limited, but I\'ll be\r\n  available every Tuesday. Unfortunately, I\'m not available on Saturdays and\r\n  Sundays due to my restaurant job. I\'ll wait to hear from you prior to the\r\n  orientation and training next week.<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin-bottom:0cm;mso-add-space:auto;\r\n  line-height:normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span lang=\"EN-US\">Thank you for your time,<o:p></o:p></span></p>\r\n  <p class=\"MsoListParagraphCxSpFirst\" style=\"margin-bottom:0cm;mso-add-space:\r\n  auto;line-height:normal\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraphCxSpLast\" style=\"margin-bottom:0cm;mso-add-space:\r\n  auto;line-height:normal\"><span lang=\"EN-US\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Josh<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table><span style=\"text-indent: 18pt; font-size: calc(12px + 2 * ((100vw - 600px) / 540));\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;How many hours will Josh likely be able to\r\nvolunteer on the day he is available?</span>', '#_#1_#_4#_#2_#_6#_#3_#_8#_#4_#_10#_#5_#_#_#6_#_#_#', '3'),
(162, 89, '<div><span style=\"font-size: 13.4074px;\">Slow down or we are going to have an accident. You</span><span lang=\"EN-US\" style=\"font-size:11.0pt;line-height:\r\n107%;font-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:Calibri;mso-fareast-theme-font:minor-latin;mso-hansi-theme-font:\r\nminor-latin;mso-bidi-font-family:&quot;Times New Roman&quot;;mso-bidi-theme-font:minor-bidi;\r\nmso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:AR-SA;\r\nmso-no-proof:yes\">&nbsp;___&nbsp;</span><span style=\"font-size: 13.4074px;\">drive so fast&nbsp;</span></div>', '#_#1_#_Should&nbsp;#_#2_#_Ought to&nbsp;#_#3_#_Shouldn’t&nbsp;#_#4_#_<div>Need to&nbsp;</div>#_#5_#_#_#6_#_#_#', '3'),
(163, 89, '<div><span style=\"font-size: 13.9899px;\">You</span><font face=\"Calibri, sans-serif\"><span style=\"font-size: 14.6667px;\">&nbsp;</span></font><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">___</span>do your homework on Saturday morning. That way, you’ll have the rest of the weekend free.&nbsp;</div><div><br></div>', '#_#1_#_Ought to&nbsp;#_#2_#_Should not&nbsp;#_#3_#_Must&nbsp;#_#4_#_Have to&nbsp;#_#5_#_#_#6_#_#_#', '1'),
(164, 89, '<div><span style=\"font-size: 13.9899px;\">You&nbsp;</span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">___&nbsp;</span>take an umbrella. It might rain&nbsp;</div>', '#_#1_#_Has to&nbsp;#_#2_#_Might&nbsp;#_#3_#_Should&nbsp;#_#4_#_Should not&nbsp;&nbsp;#_#5_#_#_#6_#_#_#', '3');
INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(165, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"553\" valign=\"top\" style=\"width:414.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><a name=\"_Hlk129081881\"><span lang=\"EN-US\">A survey\r\n  shows that 16 to 24-year olds spend over 27 hours a week online. This figure\r\n  has trebled in 10 years. A communications group conducted the study as part\r\n  of media use and attitudes report. Most online content is accessed on\r\n  computers, with the use of mobile devices quickly catching up. Two thirds of\r\n  adults now use smartphones. People also spend more time watching videos,\r\n  playing games, messaging, and checking social media online.<o:p></o:p></span></a></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin:0cm;mso-add-space:auto;text-align:\r\n  justify;line-height:normal;tab-stops:183.8pt\"><span lang=\"EN-US\">An industry expert said that new technologies are opening up\r\n  countless possibilities for young people. He said that it\'s not just for\r\n  watching content. He also said that we are changing the way we watch TV. Over\r\n  a quarter of young people watch TV online instead of on televisions.<o:p></o:p></span></p>\r\n  </td>\r\n  \r\n </tr>\r\n</tbody></table>\r\n\r\n\r\n\r\n<p class=\"MsoListParagraph\"><span lang=\"EN-US\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Why is it\r\nnewsworthy?<o:p></o:p></span></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Because smartphones and video games sell cheaply.&nbsp;</span></div>#_#2_#_Because technologies attract people of different ages.&nbsp;#_#3_#_Because the number of people online has grown fast.&nbsp;#_#4_#_Because people have changed the way they watch TV.#_#5_#_#_#6_#_#_#', '2'),
(166, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"553\" valign=\"top\" style=\"width:414.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">A survey shows that 16 to 24-year olds\r\n  spend over 27 hours a week online. This figure has trebled in 10 years. A\r\n  communications group conducted the study as part of media use and attitudes\r\n  report. Most online content is accessed on computers, with the use of mobile\r\n  devices quickly catching up. Two thirds of adults now use smartphones. People\r\n  also spend more time watching videos, playing games, messaging, and checking\r\n  social media online.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin:0cm;mso-add-space:auto;text-align:\r\n  justify;line-height:normal;tab-stops:183.8pt\"><span lang=\"EN-US\">An industry\r\n  expert said that new technologies are opening up countless possibilities for\r\n  young people. He said that it\'s not just for watching content. He also said\r\n  that we are changing the way we watch TV. Over a quarter of young people\r\n  watch TV online instead of on televisions.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoListParagraph\"><span lang=\"EN-US\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; The word\r\n\'trebled\' implies that 10 years ago....&nbsp;<o:p></o:p></span></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">People spent approximately 9 hours a week online.&nbsp;</span></div>#_#2_#_Children started to stay online at the age of 5 or 6.&nbsp;#_#3_#_Eight year-olds spent 27 hours a week online.&nbsp;#_#4_#_In 30 years, all people will chat online.#_#5_#_#_#6_#_#_#', '1'),
(167, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"553\" valign=\"top\" style=\"width:414.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">A survey shows that 16 to 24-year\r\n  olds spend over 27 hours a week online. This figure has trebled in 10 years.\r\n  A communications group conducted the study as part of media use and attitudes\r\n  report. Most online content is accessed on computers, with the use of mobile\r\n  devices quickly catching up. Two thirds of adults now use smartphones. People\r\n  also spend more time watching videos, playing games, messaging, and checking\r\n  social media online.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;text-align:justify;line-height:\r\n  normal;tab-stops:183.8pt\"><span lang=\"EN-US\">&nbsp;</span></p>\r\n  <p class=\"MsoListParagraph\" style=\"margin:0cm;mso-add-space:auto;text-align:\r\n  justify;line-height:normal;tab-stops:183.8pt\"><span lang=\"EN-US\">An industry\r\n  expert said that new technologies are opening up countless possibilities for\r\n  young people. He said that it\'s not just for watching content. He also said\r\n  that we are changing the way we watch TV. Over a quarter of young people\r\n  watch TV online instead of on televisions.<o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:22.5pt;tab-stops:36.0pt\"><span lang=\"EN-US\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; …….. makes television remain uniquely important.<o:p></o:p></span></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">New technology&nbsp;</span></div>#_#2_#_Large screen quality.&nbsp;#_#3_#_Cable television network.&nbsp;#_#4_#_An important smartphone.&nbsp;#_#5_#_#_#6_#_#_#', '1'),
(168, 89, '<div><span style=\"font-size: 13.9899px;\">\"If the bus driver had been more careful, the accident wouldn\'t have happened.”</span></div><div><span style=\"font-size: 13.9899px;\">It can be concluded that …….</span></div><div><br></div>', '#_#1_#_There was a bus accident.#_#2_#_The bus driver was careful.#_#3_#_There were no accidents at all.&nbsp;#_#4_#_We need more careful drivers.&nbsp;#_#5_#_#_#6_#_#_#', '1'),
(169, 89, '<div><span style=\"font-size: 13.9899px;\">“If we go to London, we will visit the Tower.\"&nbsp;</span></div><div><span style=\"font-size: 13.9899px;\">It can be concluded that ……</span></div>', '#_#1_#_We are already in London.&nbsp;#_#2_#_It is probable that we visit the Tower.&nbsp;#_#3_#_We stayed at home.#_#4_#_It was a fact that we were in London.#_#5_#_#_#6_#_#_#', '2'),
(170, 89, '<div><span style=\"font-size: 13.9899px;\">Indra&nbsp; : You look terribly ill. Can you continue our hill walk?&nbsp;</span></div><div><span style=\"font-size: 13.9899px;\">Silvi&nbsp; &nbsp; &nbsp;: ……………….</span></div>', '#_#1_#_If I weren\'t ill, I would be able to continue our hill walk.&nbsp;#_#2_#_If I had the strength, I would have continued our hill walk.#_#3_#_If I was ill, I would be able to continue our hill walk.&nbsp;#_#4_#_If I had not been ill, I would not have continued our hill walk.#_#5_#_#_#6_#_#_#', '1'),
(171, 89, '<table class=\"MsoTableGrid\" border=\"1\" cellspacing=\"0\" cellpadding=\"0\" style=\"margin-left: 36pt; border: none;\">\r\n <tbody><tr>\r\n  <td width=\"601\" valign=\"top\" style=\"width:450.8pt;border:solid windowtext 1.0pt;\r\n  mso-border-alt:solid windowtext .5pt;padding:0cm 5.4pt 0cm 5.4pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal;tab-stops:\r\n  70.5pt\"><span lang=\"EN-US\">To&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : All Students<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:0cm;margin-top:\r\n  0cm;mso-margin-bottom-alt:12.75pt;mso-margin-top-alt:0cm;mso-add-space:auto;\r\n  text-align:justify;line-height:normal\"><span lang=\"EN-US\">To celebrate the Hero’s day, our Student Organization will\r\n  hold some interesting programs such as English Speech Contest, Story Telling\r\n  and Class Wall Magazine Competition.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:0cm;margin-top:\r\n  0cm;mso-margin-bottom-alt:12.75pt;mso-margin-top-alt:0cm;mso-add-space:auto;\r\n  text-align:justify;line-height:normal\"><span lang=\"EN-US\">Time&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :\r\n  November 15, 2023, 8.00 a.m. – 13.00 p.m.<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:0cm;margin-top:\r\n  0cm;mso-margin-bottom-alt:12.75pt;mso-margin-top-alt:0cm;mso-add-space:auto;\r\n  text-align:justify;line-height:normal\"><span lang=\"EN-US\">Theme&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :\r\n  Hero<o:p></o:p></span></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;margin-bottom:0cm;margin-top:\r\n  0cm;mso-margin-bottom-alt:12.75pt;mso-margin-top-alt:0cm;mso-add-space:auto;\r\n  text-align:justify;line-height:normal\"><span lang=\"EN-US\">Registration&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; :\r\n  Faisal (The coordinator of this program) <o:p></o:p></span></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\nmargin-left:36.0pt;mso-add-space:auto;text-align:justify\"><span lang=\"EN-US\">Based on the text we can say that …<o:p></o:p></span></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">The programs will last for 5 hours</span></div><div><br></div>#_#2_#_The program will be held in the Hero Street#_#3_#_Two competitions will be held#_#4_#_Faisal is one of judges of the programs#_#5_#_#_#6_#_#_#', '1');
INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(172, 89, '<p><img src=\"data:image/png;base64,\" alt=\"\" style=\"width: 100%;\"></p><p><span lang=\"EN-US\" style=\"font-size:11.0pt;line-height:\r\n107%;font-family:&quot;Calibri&quot;,sans-serif;mso-ascii-theme-font:minor-latin;\r\nmso-fareast-font-family:Calibri;mso-hansi-theme-font:minor-latin;mso-bidi-theme-font:\r\nminor-latin;mso-ansi-language:EN-US;mso-fareast-language:EN-US;mso-bidi-language:\r\nAR-SA\">What kind of soup that has the most expensive price?</span><br></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Sizzling Rice Seafood Soup</span></div><div><br></div>#_#2_#_Chicken Corn Soup#_#3_#_Egg Drop Soup#_#4_#_Chicken Winter Melon Soup#_#5_#_#_#6_#_#_#', '4');
INSERT INTO `tb_soal_detail` (`id`, `id_soal`, `pertanyaan`, `jawaban`, `kunci`) VALUES
(173, 89, '<div><span style=\"font-size: 13.9899px;\">My father is a teacher and my mother is a housewife. I have two brothers. ... are studying at university.</span></div>', '#_#1_#_They#_#2_#_&nbsp;Their#_#3_#_Them#_#4_#_We#_#5_#_#_#6_#_#_#', '1'),
(174, 89, '<div><span style=\"font-size: 13.9899px;\">I live with my parents and one little sister. I enjoy playing scrabble in my free time. I also have a pet, Miaw … is a Persian cat.</span></div>', '#_#1_#_&nbsp;It#_#2_#_&nbsp;It\'s#_#3_#_&nbsp;Its#_#4_#_This#_#5_#_#_#6_#_#_#', '1'),
(175, 90, '<div><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.7pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"line-height: 112%;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-size: 16px;\"><font face=\"Times New Roman, serif\">&nbsp; &nbsp; &nbsp;</font></span><span style=\"font-family: &quot;Times New Roman&quot;; font-size: 7pt; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;\">&nbsp;</span></span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Cermati kutipan paragraf berikut! </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:3.1pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:28.25pt;line-height:111%;border:none;mso-border-alt:\r\nsolid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:111%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Pada\r\nawalnya, <i>dampak</i> media social bagi\r\nseseorang belum begitu <i>signifikan</i>.\r\nAkan tetapi, dalam jangka panjang, kecanduan terhadap layanan ini akan membawa\r\nmasalah dalam kehidupan, urusan pekerjaan, dan hubungan social </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Arti kata <i>dampak </i>dan\r\n<i>signifikan</i> pada kutipan paragraf\r\ntersebut adalah…&nbsp;</span><o:p></o:p></p></div>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Akibat dan terasa penting&nbsp;</span></div>#_#2_#_Akibat dan berpengaruh&nbsp;#_#3_#_Pengaruh dan berpengaruh&nbsp;#_#4_#_Hasil dan terasa penting&nbsp;#_#5_#_Manfaat dan berpengaruh&nbsp;#_#6_#_#_#', '1'),
(176, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.85pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp; Cermati paragraf berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:4.15pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:35.2pt;line-height:111%;border:none;mso-border-alt:\r\nsolid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:111%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Para\r\npeneliti menyimpulkan bahwa ekstrak seledri memiliki manfaat antihipertensi.\r\nSetelah memiliki kandungan <i>phthalides</i>,\r\nyaitu senyawa kimia organik yang dapat menurunkan hormon stress dalam darah.\r\nKandungan kalium pada seledri memiliki peran untuk merelaksasi jaringan dinding\r\npembuluh darah arteri. Kondisi ini dapat meningkatkan aliran darah dan\r\nmenurunkan tekanan darah sehingga dapat menurunkan risiko terjadinya masalah\r\npada sistem kardiovaskular. </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<span style=\"font-size: 12pt; line-height: 107%; font-family: &quot;Times New Roman&quot;, serif;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Gagasan pokok paragraf tersebut adalah…</span>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Ekstrak seledri memiliki manfaat antihipertensi.&nbsp;</span></div>#_#2_#_Seledri dapat menurunkan stress dalam darah.&nbsp;#_#3_#_Kandungan kalium dapat merelaksasi jaringan dinding pembuluh darah.#_#4_#_Ekstrak seledri dapat melancarkan aliran darah.&nbsp;#_#5_#_Ekstrak seledri mampu menurunkan tekanan darah&nbsp;#_#6_#_#_#', '1'),
(177, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.85pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp; Cermati paragraf berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:.5pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:35.2pt;line-height:111%;border:none;mso-border-alt:\r\nsolid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:111%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Lingkungan\r\nbelajar efektif adalah sebuah lingkungan belajar yang produktif dan didesain\r\nuntuk meningkatkan produktivitas belajar siswa. </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:2.3pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:35.2pt;line-height:111%;border:none;mso-border-alt:\r\nsolid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:111%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Hal ini agar\r\nproses belajar-mengajar berlangsung sesuai dengan harapan. Dengan begitu, akan\r\nberakibat adanya kemudahan berpikir siswa, serta kreasi yang aktif karena\r\nlingkungan belajar yang bersih, tertib, dan nyaman. </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Simpulan yang sesuai dengan paragraf tersebut adalah…&nbsp;</span><o:p></o:p></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Lingkungan belajar siswa yang efektif memberikan kemudahan kepada para siswa untuk berpikir produktif&nbsp;</span></div>#_#2_#_Desain lingkungan yang produktif akan meningkatkan prestasi belajar dan kenyamanan proses belajar-mengajar.#_#3_#_Lingkungan belajar berpengaruh terhadap produktivitas belajar, semangat belajar, dan proses belajar-mengajar.&nbsp;#_#4_#_Produktivitas dan semangat belajar dipengaruhi oleh kreativitas dalam membuat desain lingkungan belajar yang produktif.&nbsp;#_#5_#_Semangat belajar, prestasi belajar, dan proses belajar-mengajar akan meningkat jika lingkungan belajar didesain secara menarik.&nbsp;#_#6_#_#_#', '3'),
(178, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.85pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:112%;font-family:\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\">&nbsp; &nbsp; &nbsp; Cermati kutipan teks editorial berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:0cm\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:.5pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:35.2pt;line-height:111%;border:none;mso-border-alt:\r\nsolid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:111%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">Pada jam-jam\r\nsibuk, jalanan di ibu kota menjelma bak tempat parkir terpanjang di dunia.\r\nKemacetan di Jakarta telah pula menyebabkan kerugian finansial karena\r\npenggunaan BBM dan waktu di jalan. Pemerintah mengestimasi kerugian sudah\r\nmencapai RP 65 triliun hingga Rp 100 triliun per tahun. </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:.15pt;text-indent:35.2pt;line-height:\r\n114%;border:none;mso-border-alt:solid black .5pt;padding:0cm;mso-padding-alt:\r\n0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:114%;font-family:\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\">Kemacetan yang begitu akut di Jakarta terjadi karena daya\r\ntamping jalan tidak mampu menampung ekspansi kendaraan. Hal itunkarena warga\r\ndari daerah penyangga ikut membanjirinya untuk menuju tempat kerja di ibu kota.\r\n</span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:.5pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:35.2pt;line-height:111%;border:none;mso-border-alt:\r\nsolid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:111%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">Kita sudah\r\ntahu bahwa banyak upaya yang sudah dilakukan para pemangku kepentingan untuk\r\nmengatasi kemacetan Jakarta. Namun, harus kita katakana pula, upayaupaya itu\r\nmasih jauh dari optimal.&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-bottom:.5pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:35.2pt;line-height:111%;border:none;mso-border-alt:\r\nsolid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:111%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:\"times=\"\" roman\"\"=\"\"><br></span><span style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (</span><i style=\"font-family: Calibri, sans-serif; font-size: 11pt;\">Media Indonesia, 27 Maret 2019)</i></p><p class=\"MsoNormal\" style=\"margin-bottom:.5pt;text-align:justify;text-justify:\r\ninter-ideograph;text-indent:35.2pt;line-height:111%;border:none;mso-border-alt:\r\nsolid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:111%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span><span style=\"color: rgb(41, 41, 41); font-size: 32.4968px; text-indent: 0cm;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;</span></p><h1 style=\"margin-top:0cm;margin-right:0cm;margin-bottom:4.8pt;margin-left:\r\n0cm;text-indent:0cm;tab-stops:center 54.0pt 90.05pt 126.05pt 162.05pt 198.05pt 234.1pt 270.1pt 389.35pt\"><o:p></o:p></h1>\r\n\r\n</div>\r\n\r\n<span style=\"font-size: 12pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Pandangan penulis yang sesuai dengan teks editorial tersebut adalah…</span>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Pada jam-jam sibuk, jalanan di ibu kota menjelma sebagai tempat parkir terpanjang di dunia. </span></div>#_#2_#_Kemacetan di Jakarta telah pula menyebabkan kerugian finansial yang dialami pemerintah sampai dengan Rp 100 triliun per tahun. #_#3_#_Kemacetan di Jakarta terjadi karena daya tamping jalan tidak mampu mengatasi bertambahnya jumlah kendaraan. #_#4_#_Kepadatan penduduk di Jakarta diakibatkan oleh membanjirnya warga daerah penyangga masuk ibu kota. #_#5_#_Banyak upaya yang sudah dilakukan pemangku kepentingan untuk mengatasi kemacetan Jakarta. #_#6_#_#_#', '3'),
(179, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.65pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp; Cermati kalimat berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:4.15pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Gunungkidul, sebuah kabupaten di Daerah Istimewa Yogyakarta\r\nyang sebagian wilayahnya terdiri atas bukit-bukit batu kapur ternyata memiliki\r\npotensi wisata pantai yang indah. </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Inti kalimat tersebut adalah…&nbsp;</span><o:p></o:p></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Gunungkidul memiliki potensi wisata pantai&nbsp;</span></div>#_#2_#_Gunungkidul merupakan kabupaten yang memiliki potensi wisata.#_#3_#_Gunungkidul memiliki bukit kapur dan wisata pantai.&nbsp;#_#4_#_Sebagian wilayah Gunungkidul terdiri atas bukit dan batu kapur.&nbsp;#_#5_#_Gunungkidul menjadi kabupaten yang dikenal memiliki pantai yang indah#_#6_#_#_#', '1'),
(180, 90, '<div><span style=\"font-size: 13.9899px;\">Cermati paragraf berikut.&nbsp;</span></div><div><span style=\"font-size: 13.9899px;\">(1) Mata yang digunakan untuk melihat computer, telepon pintar, atau tablet dalam waktu lama diduga akan membuat mata lelah. (2) Dampak lainnya adalah mata menjadi minus. (3) efek buruk ini tidak hanya dialami oleh orang dewasa, tetapi juga anak-anak. (4) Para orang tua sebaiknya mengingatkan anak untuk tidak bergantung pada computer. (5) Dengan demikian, tidak terjadi penurunan kualitas kesehatan mata anak.&nbsp;</span></div><div><span style=\"font-size: 13.9899px;\">&nbsp;</span></div><div><span style=\"font-size: 13.9899px;\">Kalimat berupa fakta dalam paragraf tersebut ditandai dengan nomor…&nbsp;</span></div>', '#_#1_#_(1) dan (2)&nbsp;#_#2_#_(2) dan (3)#_#3_#_(3) dan (4)&nbsp;#_#4_#_(3) dan (5)#_#5_#_(4) dan (5)#_#6_#_#_#', '2'),
(181, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.85pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp; Cermati paragraf berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:2.9pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">(1)</span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\"> </span><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Mengonsumsi makanan organik dinilai sebagai salah satu\r\npenunjang gaya hidup sehat kekinian. (2) Makanan organik dianggap lebih\r\nmenyehatkan dibandingkan makanan nonorganik karena bersih, ramah lingkungan,\r\ndan bebas dari perstisida. (3) Harga makanan organik lebih mahal daripada\r\nmakanan nonorganik. (4) Makanan organik memiliki peminat khusus. (5) Saat ini,\r\npola gaya hidup sehat dengan mengonsumsi makanan organik banyak dilakukan\r\nmasyarakat. </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Kalimat berupa opini dalam paragraf tersebut ditandai dengan\r\nnomor…&nbsp;</span><o:p></o:p></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">(1) dan (2)&nbsp;</span></div><div><br></div><div><br></div>#_#2_#_(1) dan (4)#_#3_#_(2) dan (4)&nbsp;#_#4_#_(3) dan (4)&nbsp;#_#5_#_&nbsp;(4) dan (5)&nbsp;#_#6_#_#_#', '1'),
(182, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.7pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp; Cermati paragraf berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:3.9pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Pemerintah harus melakukan […] pengajaran Pancasila sebagai\r\ndasar Negara di dunia pendidikan. Pola […] dan penafsiran tunggal telah\r\nmengerdilkan Pancasila dan membuatnya ditinggalkan sebagai ideology berbangsa\r\ndan bernegara. </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Istilah yang tepat untuk melengkapi paragraf tersebut\r\nadalah…&nbsp;</span><o:p></o:p></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">rehabilitasi, instruksi&nbsp;</span></div>#_#2_#_restrukturisasi, indoktrinasi#_#3_#_revitalisasi, indoktrinasi#_#4_#_reformasi, institusi#_#5_#_revolusi, instruksi&nbsp;#_#6_#_#_#', '3'),
(183, 90, '<div style=\"text-align: justify; text-indent: -28.5333px;\"><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Cermati paragraf berikut.&nbsp;</span></font></div>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:0cm\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.5pt;\r\nmargin-left:18.0pt;text-indent:-18.0pt;line-height:111%;mso-list:l1 level3 lfo2;\r\nborder:none;mso-border-alt:solid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:111%;font-family:\" times=\"\" new=\"\" roman\",serif;=\"\" mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">(1)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" times=\"\" new=\"\" roman\";\"=\"\">&nbsp;&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:111%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">Indonesia\r\nharus membangun kemandirian dengan kekuatan yang dimilikinya sendiri. </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:2.6pt;\r\nmargin-left:18.0pt;text-indent:-18.0pt;line-height:114%;mso-list:l1 level3 lfo2;\r\nborder:none;mso-border-alt:solid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:114%;font-family:\" times=\"\" new=\"\" roman\",serif;=\"\" mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">(2)<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: \" tim