(184, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.85pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"line-height: 112%;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal; font-size: 16px;\"><font face=\"Times New Roman, serif\">&nbsp; &nbsp; &nbsp;</font></span><span style=\"font-family: &quot;Times New Roman&quot;; font-size: 7pt; font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; line-height: normal;\">&nbsp;</span></span><!--[endif]--><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Cermati paragraf berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:3.3pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">(1) Budaya adalah cara hidup yang berkembang dan dimiliki\r\nbersama oleh kelompok orang yang diwariskan turun-temurun. (2) Budaya terbentuk\r\ndari berbagai banyak unsur-unsur yang rumit, termasuk sistem agama dan politik,\r\nadat istiadat, bahasa, perkakas, pakaian, bangunan, dan karya seni. (3)\r\nUnsur-unsur tersebut berkembang baik di kalangan masyarakat pemiliknya. (4)\r\nFaktor-faktor pemengaruh dari luar komunitas budaya itu tidak mudah memengaruhi\r\npakem masyarakat setempat. (5) Akhirnya, budaya relatif tetap dan tidak mudah\r\nberkembang. </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Perbaikan kalimat tidak efektif pada kalimat (2) dalam\r\nparagraf tersebut adalah…&nbsp;</span><o:p></o:p></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Pembentukan budaya dari berbagai unsur-unsur yang rumit, termasuk sistem agama dan politik, adat istiadat, bahasa, perkakas, pakaian, bangunan, dan karya seni.&nbsp;</span></div>#_#2_#_Banyak unsur-unsur budaya yang rumit, termasuk sistem agama dan politik, adat istiadat, bahasa, perkakas, pakaian, bangunan, dan karya seni.&nbsp;#_#3_#_Berbagai banyak unsur-unsur yang rumit, seperti agama dan politik, adat istiadat, bahasa, perkakas, pakaian, bangunan, dan karya seni.&nbsp;#_#4_#_Unsur-unsur yang rumit, termasuk sistem agama dan politik, adat istiadat, bahasa, perkakas, pakaian, bangunan, dan karya seni dibentuk oleh budaya masyarakat.&nbsp;#_#5_#_Budaya terbentuk dari banyak unsur yang rumit, misalnya agama dan politik, adat istiadat, bahasa, perkakas, pakaian, bangunan, dan karya sastra.&nbsp;#_#6_#_#_#', '5'),
