:0cm;margin-right:0cm;margin-bottom:.65pt;\r\nmargin-left:39.15pt;text-indent:-.5pt;line-height:103%\"><span style=\"font-size:\r\n12.0pt;mso-bidi-font-size:11.0pt;line-height:103%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\">Tuhanku </span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.65pt;\r\nmargin-left:39.15pt;text-indent:-.5pt;line-height:103%\"><span style=\"font-size:\r\n12.0pt;mso-bidi-font-size:11.0pt;line-height:103%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\">Aku mengembara di\r\nnegeri asing. </span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.65pt;\r\nmargin-left:39.15pt;text-indent:-.5pt;line-height:103%\"><span style=\"font-size:\r\n12.0pt;mso-bidi-font-size:11.0pt;line-height:103%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\">Tuhanku </span><o:p></o:p></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:289.7pt;margin-bottom:\r\n2.0pt;margin-left:39.15pt;text-indent:-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:103%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#222222\">Di\r\npintu-Mu aku mengetuk. Aku tak bisa berpaling. </span><o:p></o:p></p><p>\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n\r\n</p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Amanat dalam kutipan puisi tersebut adalah…&nbsp;</span><o:p></o:p></p>', '#_#1_#_<div><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">Berdoalah dengan sungguh-sungguh supaya selalu ditunjukkan ke jalan yang benar.&nbsp;</span></font></div>#_#2_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Ingatlah selau kepada Tuhan di mana pun berada agar senantiasa mendapatkan kemudahan.&nbsp;</span>#_#3_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Pertolongan dari Tuhan akan datang kepada orang yang selalu berdoa dan selalu memohon petunjuk.&nbsp;</span>#_#4_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Bertobat dan kembalilah kepada Tuhan apabila telah menyadari perbuatan salah yang pernah dilakukan.&nbsp;</span>#_#5_#_<span style=\"font-family: &quot;Times New Roman&quot;, serif; font-size: 16px;\">Seseorang yang tidak mendapatkan petunjuk dari Tuhan akan kehilangan pedoman dalam hidupnya.</span>#_#6_#_#_#', '4');
