(188, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.65pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:112%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp;Cermati\r\nkutipan teks berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:3.1pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Dia rajin seminggu dua kali singgah sebentar di kontrakan\r\nbaru dengan membawa makanan, buku-buku untukku, serta permainan buat adikku.\r\nAku dan Dede selalu menunggu kunjungan tersebut dengan dududk di depan\r\nkontrakan menatap kelokan gang. Kami menunggu jadwal kedatangannya setiap\r\nSelasa dan Jumat malam. </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Watak tokoh <i>dia</i>\r\npada kutipan tersebut adalah…&nbsp;</span><o:p></o:p></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">penakut <span style=\"white-space:pre\">	</span> <span style=\"white-space:pre\">	</span>&nbsp;</span></div>#_#2_#_penyayang&nbsp;#_#3_#_perajin&nbsp;#_#4_#_penyabar&nbsp;#_#5_#_pemalas&nbsp;#_#6_#_#_#', '2'),
(189, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:2.75pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:112%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp; Cermati\r\nkutipan teks berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:3.3pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">(1)</span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\"> </span><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">“Yaaa. Kok, mendadak, Pal?” anak-anak berseru kecewa,\r\nserempak. Termasuk Seli. (2) Pak Gun menggelen. “Kalian harus terbiasa belajar\r\nsetiap hari, mempersiapkan diri. (3) tinggal satu minggu lagi ujian akhir\r\nsemester. (4) Bapak kecewa dengan nilai-rata-rata yang hanya tujuh. (5) Akan\r\ntetapi, Bapak percaya kalian bisa lebih baik lagi.” </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Bukti bahwa <i>Pak Gun</i>\r\nmemiliki sikap tegas terletak pada kalimat bernomor…&nbsp;</span><o:p></o:p></p>', '#_#1_#_(1)#_#2_#_(2)#_#3_#_<p>(3)</p>#_#4_#_(4)#_#5_#_(5)#_#6_#_#_#', '4'),
(190, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.85pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;line-height:112%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;\"><span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp;</span></span><!--[endif]--><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:112%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Cermati\r\nkutipan cerpen berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:3.45pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">(1)</span><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Arial&quot;,sans-serif;mso-fareast-font-family:\r\nArial\"> </span><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Gumpalan awan hitam seakan bosan beranjak di atas sana. (2)\r\nSatu dua tetes air mengenai jendela kelas, lalu terbawa angina. (3) Udara\r\nterasa lembap dan dingin. (4) Tak lama lagi musim kemarau yang kering akan\r\ntiba. (5) “Bagus sekali, Ali! Kamu lagi-lagi memperoleh nilai terbaik.” </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<span style=\"font-size: 12pt; line-height: 107%; font-family: &quot;Times New Roman&quot;, serif;\">Kalimat yang <i>tidak </i>menyatakan\r\nlatar waktu musim hujan ditandai dengan nomor…&nbsp;</span>', '#_#1_#_(1)#_#2_#_(2)#_#3_#_(3)#_#4_#_(4)#_#5_#_(5)#_#6_#_#_#', '5'),
(191, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.85pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:112%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp; Cermati\r\nkutipan novel berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:39.05pt;margin-right:0cm\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.5pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Entah bagaimana caranya, si tukang rebut yang pakaiannya\r\nselalu kusut, rambut berantakan, sering diusir guru dari kelas karena tidak\r\nmengerjakan PR, bertengkar, tidak punya teman (kecuali aku dan Seli), seminggu\r\nterakhir ini mendadak menjadi murid paling populer di sekolah. Semua orang\r\nmeneriakkan namanya. Ali, Ali, dan Ali. </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-bottom:4.6pt;tab-stops:center 54.0pt 90.05pt 126.05pt 162.05pt 198.05pt 234.1pt 270.1pt 350.25pt;\r\nborder:none;mso-border-alt:solid black .5pt;padding:0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;</span><span style=\"font-size:10.0pt;mso-bidi-font-size:11.0pt;line-height:107%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">(<i>Matahari, </i>Tere Liye) </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:120.85pt;margin-bottom:\r\n.5pt;margin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Amanat yang sesuai dengan isi kutipan novel tersebut adalah…&nbsp;<o:p></o:p></span></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Penampilan seseorang mencerminkan kepribadian yang dimiliki&nbsp;</span></div>#_#2_#_Jangan mudah berprasangka buruk kepada orang lain.&nbsp;#_#3_#_Di dunia ini segala sesuatu bisa terjadi tanpa diduga sebelumnya.#_#4_#_Prestasi seseorang bisa terlihat ketika ada kesempatan yang diperoleh.#_#5_#_Pujian akan datang ketika seseorang berada di puncak kesuksesan.&nbsp;#_#6_#_#_#', '1'),
(192, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:112%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp;Cermati\r\nkutipan teks anekdot berikut. </span><o:p></o:p></p>\r\n\r\n<table class=\"TableGrid\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"611\" style=\"width: 458.25pt; margin-left: 33.7pt;\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;mso-yfti-lastrow:yes;\r\n  height:478.7pt\">\r\n  <td width=\"611\" valign=\"top\" style=\"width:458.25pt;border:solid black 1.0pt;\r\n  mso-border-alt:solid black .5pt;mso-border-left-alt:solid black .75pt;\r\n  padding:1.7pt 3.55pt 0cm 5.5pt;height:478.7pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:1.0pt;\r\n  margin-left:.2pt;line-height:normal\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\">Teks 1 </span></b><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.8pt;\r\n  margin-left:.2pt;line-height:normal\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;</span></b><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:.9pt;line-height:normal;tab-stops:\r\n  center 14.8pt 50.85pt 86.85pt 158.0pt\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Jiwa\r\n  Sosialita </span></b><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:2.0pt;\r\n  margin-left:.2pt;line-height:114%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n  11.0pt;line-height:114%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n  &quot;Times New Roman&quot;\">Vina dan Rani sudah bersahabat sejak kecil. Vina tidak\r\n  suka pamer walaupun ia kaya, sedangkan Rani lebih suka berdandan dan tampak\r\n  glamor. Suatu saat, mereka berbincangbincang. </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:1.9pt;margin-bottom:\r\n  .65pt;margin-left:49.65pt;text-indent:-49.65pt;line-height:125%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:125%;\r\n  font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Rani\r\n  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : “Vi, pinjam bajumu yang kamu\r\n  beli kemarin, dong&gt; aku mau foto-foto, terus aku <i>posting </i>di Instagram.” </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\n  margin-left:49.65pt;text-indent:-49.65pt;line-height:133%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:133%;\r\n  font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Vina\r\n  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : “Rani, aku saja belum pernah\r\n  pakai baju baruku itu. Masa kamu duluan yang pakai?” </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:1.1pt;line-height:normal;tab-stops:\r\n  center 157.8pt\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\n  font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Rani\r\n  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : “Vin, kita ini kawan lama,\r\n  tapi kamu pelit.” </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.6pt;\r\n  margin-left:49.65pt;text-indent:-49.65pt;line-height:115%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:115%;\r\n  font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Dengan\r\n  berat hati, Vina kemudian menyerahkan baju baru yang dibelinya kemarin kepada\r\n  Rani. Rani lalu memakai baju baru Vina untuk berfoto dan mengunggahnya ke\r\n  media sosial. Tak lama kemudian, seseorang mengomentari foto Rani. </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\n  margin-left:49.65pt;text-indent:-49.65pt;line-height:130%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:130%;\r\n  font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Komentar:\r\n  “Rani, pinjam bajunya Vina, ya? Kok, di akunnya Vina ada foto Vina lagi beli\r\n  baju yang dipakai sama Rani?” </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:132.45pt;margin-bottom:\r\n  0cm;margin-left:.2pt;text-indent:-.2pt;line-height:116%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:116%;\r\n  font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Rani\r\n  langsung menghapus foto yang baru saja diunggahnya. <b>Teks 2 </b></span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.8pt;\r\n  margin-left:.2pt;line-height:normal\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\">Pakaian Termahal </span></b><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.8pt;\r\n  margin-left:.2pt;line-height:normal\"><b><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp;</span></b><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:3.05pt;\r\n  margin-left:.2pt;line-height:normal\"><span style=\"font-size:12.0pt;\r\n  mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n  &quot;Times New Roman&quot;\">Pada saat menyaksikan Final Miss Indonesia, Mirna\r\n  berdialog dengan ibunya. </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:3.05pt;\r\n  margin-left:.2pt;line-height:normal\"><span style=\"font-size:12.0pt;\r\n  mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n  &quot;Times New Roman&quot;\">Mirna: “ Wah, pakaian mereka bagus dan mewah, ya, Bu,\r\n  pasti harganya mahal.” </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\n  margin-left:42.65pt;text-indent:-42.45pt;line-height:134%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:134%;\r\n  font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Ibu\r\n  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : “Tentu saja mahal, tapi ada\r\n  pakaian yang jauh lebih mahal dari pakaian mewah yang dipakai para peserta\r\n  Miss Indonesia, Mir.” </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:3.0pt;\r\n  margin-left:.2pt;line-height:normal\"><span style=\"font-size:12.0pt;\r\n  mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n  &quot;Times New Roman&quot;\">Mirna: “Wah, pasti pakaiannya lebih indah dari ini, ya,\r\n  Bu?” </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:3.65pt;line-height:normal;tab-stops:\r\n  center 177.55pt\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\n  font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">Ibu\r\n  &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : “Tidak, pakaiannya biasa saja\r\n  berwarna oranye polos.” </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:3.05pt;\r\n  margin-left:.2pt;line-height:normal\"><span style=\"font-size:12.0pt;\r\n  mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n  &quot;Times New Roman&quot;\">Mirna: “Loh, kok, bisa mahal, Bu?” Memang pakaian apa\r\n  itu?” </span><o:p></o:p></p>\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:0cm;\r\n  margin-left:42.65pt;text-indent:-42.45pt;line-height:normal\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\">Ibu &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; : “Pakaian para koruptor. Mereka harus mencuri uang sebesar\r\n  miliaran rupiah untuk dapat baju itu.” </span><o:p></o:p></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Persamaan kedua teks anekdot tersebut adalah…&nbsp;</span><o:p></o:p></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Kedua teks tersebut bertema persahabatan lama.&nbsp;</span></div>#_#2_#_Latar tempat kedua teks tersebut di kompleks perumahan.&nbsp;#_#3_#_Kedua teks anekdot tersebut membahas pakaian baru yang mahal.&nbsp;#_#4_#_Kedua teks tersebut berisi perdebatan dua orang wanita.&nbsp;#_#5_#_Objek pembicaraan kedua teks tersebut adalah pakaian.#_#6_#_#_#', '5'),
(193, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-21.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:112%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">&nbsp; &nbsp; Cermati\r\nkutipan novel berikut. </span><o:p></o:p></p>\r\n\r\n<table class=\"TableGrid\" border=\"0\" cellspacing=\"0\" cellpadding=\"0\" width=\"611\" style=\"width: 458.15pt; margin-left: 33.8pt;\">\r\n <tbody><tr style=\"mso-yfti-irow:0;mso-yfti-firstrow:yes;height:82.2pt\">\r\n  <td width=\"611\" colspan=\"2\" valign=\"top\" style=\"width:458.15pt;border:solid black 1.0pt;\r\n  mso-border-alt:solid black .5pt;mso-border-bottom-alt:solid black .75pt;\r\n  padding:1.5pt 2.7pt 0cm 5.6pt;height:82.2pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:2.8pt;margin-bottom:\r\n  0cm;margin-left:0cm;text-align:justify;text-justify:inter-ideograph;\r\n  line-height:normal\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\n  font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;\">(1)</span><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Arial&quot;,sans-serif;\r\n  mso-fareast-font-family:Arial\"> </span><span style=\"font-size:12.0pt;\r\n  mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n  &quot;Times New Roman&quot;\">Aku merasakan pangkal gerahamku beradu kuat. (2) Tiba-tiba\r\n  aku patah semangat untuk terus memancing hari ini. (3) Pikiranku melayang\r\n  kembali ketika aku dan teman-temanku dulu suka melihat awan dan punya impian\r\n  tinggi. (4) Waktu itu impianku adalah menjadi seperti Habibie dan belajar\r\n  sampai ke Amerika. (5) Tapi ingatlah aku hari ini, memancing seekor ikan\r\n  danau pun tidak bisa. </span><o:p></o:p></p>\r\n  </td>\r\n </tr>\r\n <tr style=\"mso-yfti-irow:1;mso-yfti-lastrow:yes;height:18.65pt\">\r\n  <td width=\"308\" valign=\"top\" style=\"width:230.7pt;border:none;border-right:solid black 1.0pt;\r\n  mso-border-top-alt:solid black .75pt;mso-border-top-alt:solid black .75pt;\r\n  mso-border-right-alt:solid black .5pt;padding:1.5pt 2.7pt 0cm 5.6pt;\r\n  height:18.65pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><o:p>&nbsp;</o:p></p>\r\n  </td>\r\n  <td width=\"303\" valign=\"top\" style=\"width:227.5pt;border-top:none;border-left:\r\n  none;border-bottom:solid black 1.0pt;border-right:solid black 1.0pt;\r\n  mso-border-top-alt:solid black .75pt;mso-border-left-alt:solid black .5pt;\r\n  mso-border-alt:solid black .5pt;mso-border-top-alt:solid black .75pt;\r\n  padding:1.5pt 2.7pt 0cm 5.6pt;height:18.65pt\">\r\n  <p class=\"MsoNormal\" style=\"margin-bottom:0cm;line-height:normal\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;font-family:&quot;Times New Roman&quot;,serif;\r\n  mso-fareast-font-family:&quot;Times New Roman&quot;\">(<i>Ranah Tiga Warna, </i>A. Fuady) </span><o:p></o:p></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Perasaan kecewa tokoh <i>aku</i>\r\ndiwakili oleh kalimat dengan nomor…&nbsp;</span><o:p></o:p></p>', '#_#1_#_(1)#_#2_#_(2)#_#3_#_(3)#_#4_#_(4)#_#5_#_(5)#_#6_#_#_#', '5'),
(194, 90, '<div><div style=\"text-align: justify; text-indent: -28.5333px;\"><font face=\"Times New Roman, serif\"><span style=\"font-size: 16px;\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Cermati kutipan novel berikut.&nbsp;</span></font></div>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:0cm\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.5pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\">Intel Melayu yang paling adil sekali pun tak akan dapat\r\nmengenali kami. <i>&nbsp;Di mana</i> <i>ada kemauan, di situ ada jalan.</i> Pepatah lama yang dianut semua\r\nbangsa di muka bumi, benar adanya. Sungguh benar adanya.</span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.5pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;</span><font face=\"Times New Roman\"><i style=\"font-size: calc(12px + 2 * ((100vw - 600px) / 540));\"><span style=\"font-size: 11pt; line-height: 107%;\">(Sang Pemimpi, </span></i><span style=\"font-size: 11pt; line-height: 107%;\">Andrea Hirata)</span></font></p>\r\n\r\n</div>\r\n\r\n<span style=\"font-size: 12pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; Makna peribahasa <i>di mana ada\r\nkemauan, di situ ada jalan </i>pada kutipan novel tersebut adalah…</span><br></div><div><br></div>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Setiap perbuatan sangat tergantung dari niat yang menyertainya. </span></div>#_#2_#_<div>Pekerjaan berat akan terasa ringan jika dilakukan dengan sungguh-sungguh. </div>#_#3_#_Jangan berharap mendapatkan keberhasilan jika tidak mau bekerja. #_#4_#_Orang baik dihasilkan oleh lingkungan hidup yang baik pula. #_#5_#_Seseorang yang punya niat dan mau berusaha, pasti ada kemudahan untuk berhasil. #_#6_#_#_#', '5'),
(195, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.9pt;\r\nmargin-left:18.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">&nbsp; &nbsp; &nbsp; Cermati kutipan novel berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:0cm\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.5pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Tapi penilaianku lain. Itu mungkin karena aku begitu hanyut\r\ndengan gadis-gadis Mesir titisan Cleopatra, yang tinggi semampai, wajahnya\r\nputih jelita, dengan hidung melengkung indah, mata bulat bening khas Arab, dan\r\nbibir yang merah.</span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:.5pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size: 12pt; line-height: 111%;\"><span style=\"font-size: 11pt; line-height: 107%;\"><font face=\"Times New Roman\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; (<i style=\"\">pudarnya Pesona Cleopatra, </i>Habiburrahman\r\nEl-Shirazy)&nbsp;</font></span><br></span></p>\r\n\r\n</di