(200, 90, '<p></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:1.85pt;\r\nmargin-left:42.4pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-24.4pt;line-height:112%;mso-list:l0 level1 lfo1\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:112%;font-family:\r\n\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:\"times=\"\" roman\"\"=\"\">&nbsp; &nbsp; &nbsp;Cermati\r\nkutipan teks ulasan berikut. </span><o:p></o:p></p>\r\n\r\n<div style=\"mso-element:para-border-div;border:solid black 1.0pt;mso-border-alt:\r\nsolid black .5pt;padding:0cm 0cm 0cm 0cm;margin-left:38.65pt;margin-right:.05pt\">\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:2.55pt;\r\nmargin-left:.5pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:111%;border:none;mso-border-alt:solid black .5pt;padding:\r\n0cm;mso-padding-alt:0cm 0cm 0cm 0cm\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:111%;font-family:\" times=\"\" new=\"\" roman\",serif;mso-fareast-font-family:=\"\" \"times=\"\" roman\"\"=\"\">Dalam novel ini, sosok Dilan mengajarkan kita untuk selalu\r\nmenjadi diri sendiri. […]. Dalam novel ini, juga terdapat banyak makna yang\r\nbaik untuk dipahami. </span><o:p></o:p></p>\r\n\r\n</div>\r\n\r\n<span style=\"font-size: 12pt; line-height: 107%; font-family: \" times=\"\" new=\"\" roman\",=\"\" serif;\"=\"\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;Kalimat yang tepat untuk melengkapi teks ulasan&nbsp;&nbsp;</span><span style=\"font-size: 12pt;\">rumpang tersebut adalah…</span><p></p>', '#_#1_#_<div><span style=\"font-size: 13.9899px;\">Buku ini juga sangat dibuthkan oleh remaja karena mengajarkan kita untuk tidak mudah menyerah. </span></div>#_#2_#_Buku ini mengajarkan kita cara-cara menggapai cita-cita atau apa yang kita inginkan agar dapat tercapai. #_#3_#_Novel ini menceritakan kisah cinta antara Dilan dan Milea yang menarik, unik, lucu sekaligus romantic. #_#4_#_Penulis menggunakan gaya bahasa yang ringan sehingga pesan tokoh mudah dicerna dan dipahami pembaca.#_#5_#_Penulis menggunakan gambaran kehidupan sehari-hari dengan ungkapan yang tidak sulit dimengerti. #_#6_#_#_#', '4'),
