an&quot;\">: “Sama-sama, Bu.” </span><o:p></o:p></p>\r\n  </td>\r\n </tr>\r\n</tbody></table>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:.75pt;margin-bottom:.5pt;\r\nmargin-left:39.15pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:112%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:112%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;\">Interpretasi teks negosiasi tersebut adalah…&nbsp;</span><o:p></o:p></p>', '#_#1_#_<div>Pembeli 2 akan membeli petai sesuai dengan harga yang sama dengan penawaran pembeli 1.&nbsp;</div>#_#2_#_Pembeli 2 ingin membeli 3 tangkai petai seharga Rp 40.000,00 sesuai yang ditawarkan penjual&nbsp;#_#3_#_<div>Penjual dan pembeli 2 bersepakat untuk pembelian 3 tangkai petai seharga Rp&nbsp;</div><div>40.000,00.&nbsp;</div>#_#4_#_Pembeli 1 tidak bersepakat dengan penawaran yang diajukan pembeli 22 untuk pembelian seluruh tangkai petai.&nbsp;#_#5_#_Penjual menolak penawaran pembeli 2 karena sudah bersepakat dengan penawaran pembeli 1.#_#6_#_#_#', '5'),
