(215, 90, '<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Cermati contoh surat lamaran berikut ini,\r\nuntuk menjawab soal no. 41-42 !</span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\"><br></span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Makassar, 12 Juli 2022 </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Perihal : Lamaran Pekerjaan </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Lampiran .: Satu berkas</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:279.7pt;margin-bottom:\r\n0cm;margin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;\r\ntext-indent:-.5pt;line-height:200%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:\r\n11.0pt;line-height:200%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Yth. Kepala HRD PT Sari Wangi di Jalan Mawar\r\nIndah No. 12 Makassar </span><o:p></o:p></p>\r\n\r\n<br>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Dengan hormat, </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Saya, Putri Raflesia, lulusan ASMI tahun 2020,\r\nJurusan Sekretaris. Usia saya 20 tahun dengan ciri-ciri tinggi 170 cm dan berat\r\nbadan saya 60 kg. Berkulit putih bersih, tidak berkacamata. Dengan ini\r\nbermaksud untuk melamar pekerjaan menjadi Sekretaris sesuai dengan ilmu yang\r\nsaya miliki.</span></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Saya berjanji akan berkerja keras dan\r\nmengaplikasikan ilmu saya sesuai dengan pekerjaan dan untuk kemajuan perusahaan\r\nyang Bapak pimpin. Berikut ini saya lampirkan sebagai bahan pertimbangan: </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:29.45pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-12.2pt;line-height:103%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:103%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#636363\">1.<span style=\"font-variant-numeric: normal; font-variant-east-asian: normal; font-variant-alternates: normal; font-kerning: auto; font-optical-sizing: auto; font-feature-settings: normal; font-variation-settings: normal; font-stretch: normal; font-size: 7pt; line-height: normal; font-family: &quot;Times New Roman&quot;;\">&nbsp; </span></span><!--[endif]--><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;line-height:103%;font-family:\r\n&quot;Times New Roman&quot;,serif;mso-fareast-font-family:&quot;Times New Roman&quot;;color:#636363\">Daftar\r\nRiwyat Hidup </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:29.45pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-12.2pt;line-height:103%;mso-list:l0 level1 lfo1\"><!--[if !supportLists]--><span style=\"font-size:12.0pt;line-height:103%;font-family:&quot;Times New Roman&quot;,serif;\r\nmso-fareast-font-family:&quot;Times New Roman&quot;;color:#636363\">2.<span style=\"font-variant-numeric: normal; font-