103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Besar harapan saya untuk dapat bergabung\r\ndengan perusahaan yang Bapak/Ibu pimpin. Atas perhatian Bapak/Ibu, saya\r\nmenyampaikan terima kasih. </span><o:p></o:p></p>\r\n\r\n<br>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">ttd </span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:12.8pt;\r\nmargin-left:18.0pt\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:107%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">&nbsp;</span><o:p></o:p></p>\r\n\r\n<p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\">Putri Raflesia&nbsp;</span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\"><br></span></p><p class=\"MsoNormal\" style=\"margin-top:0cm;margin-right:0cm;margin-bottom:13.4pt;\r\nmargin-left:17.75pt;text-align:justify;text-justify:inter-ideograph;text-indent:\r\n-.5pt;line-height:103%\"><span style=\"font-size:12.0pt;mso-bidi-font-size:11.0pt;\r\nline-height:103%;font-family:&quot;Times New Roman&quot;,serif;mso-fareast-font-family:\r\n&quot;Times New Roman&quot;;color:#636363\"><span style=\"font-size: 12pt; line-height: 107%;\">Pernyataan yang sesuai dengan pemerian surat tersebut\r\nadalah….&nbsp;</span><br></span><o:p></o:p></p>', '#_#1_#_<div>Pemerian bukti kemampuan pada surat lamaran pekerjaan masih salah setiap pemerian tidak diakhiri dengan titik koma.&nbsp;</div>#_#2_#_Pemerian bukti kemampuan pada surat lamaran kerja tersebut sudah baik karena menggunakan huruf kecil.&nbsp;#_#3_#_Pemerian bukti kemampuan pada surat lamaran pekerjaan tersebut tidak tepat karena menggunakan huruf kecil.&nbsp;#_#4_#_Pemerian bukti kemampuan pada surat lamaran pekerjaan tersebut tidak tepat karena menggunakan huruf kapital dan setiap pemerian diakhiri dengan titik koma.&nbsp;#_#5_#_Pemerian bukti kemampuan pada surat lamaran pekerjaan tersebut tidak tepat karena menggunakan huruf kapital dan setiap pemerian tidak diakhiri dengan titik koma.&nbsp;#_#6_#_#_#', '5'),
(217, 90, '<div>Rumusan alinea pembuka pada surat lamaran pekerjaan yang tepat adalah.…&nbsp;</div>', '#_#1_#_<p>Demikian lamaran pekerjaan ini saya buat. Besar harapan saya agar Bapak/Ibu berkenan untuk mempertimbangkan saya guna menempati posisi yang telah disebutkan di atas. Atas perhatian dan kebijaksanaannya saya ucapkan terima kasih.&nbsp;<br></p>#_#2_#_Berdasarkan informasi yang saya peroleh dari situs resmi PT. Satu Dua Tiga, bahwa perusahaan yang Bapak/Ibu pimpin sedang membutuhkan tenaga kerja untuk menempati posisi Staff Produksi.&nbsp;#_#3_#_Berdasarkan keterangan di atas, saya bermaksud untuk melamar pekerjaan untuk posisi Staff Produksi di instansi yang Bapak/Ibu yang pimpin sekarang.&nbsp;#_#4_#_Berdasarkan informasi yang saya peroleh dari situs resmi PT. Bank Rakyat Indonesia, bahwa perusahaan yang Bapak/Ibu pimpin sedang membutuhkan tenaga kerja untuk menempati posisi Frontliner.&nbsp;#_#5_#_Berdasarkan keterangan di atas, saya bermaksud untuk melamar pekerjaan untuk posisi Frontliner di instansi yang Bapak/Ibu yang pimpin sekarang.&nbsp;#_#6_#_#_#', '2'),
(218, 90, '<div>Bacalah teks editorial di bawah ini!&nbsp;</div><div>Banjir yang selalu melanda Ibu Kota Jakarta sudah tidak bisa ditoleransi dan di maklumi lagi. Di situasi seperti ini, harusnya muncul solusi yang cepat dan tepat guna mengatasi bencana tersebut sebelum Jakarta benar-benar tenggelam. Salah satu solusi yang diberikan oleh Pemkot DKI Jakarta yaitu program normalisasi sungai. Program normalisasi sungai tersebut berupa pengosongan lahan di sekitar sungai-sungai yang ada di Jakarta.&nbsp;</div><div>Teks di atas termasuk struktur bagian …&nbsp;</div><div><br></div>', '#_#1_#_<div>Pernyataan umum</div>#_#2_#_Argumentasi&nbsp;#_#3_#_Penegasan ulang#_#4_#_Penutupan#_#5_#_Koda&nbsp;#_#6_#_#_#', '1'),
(219, 90, '<div>Bacalah teks di bawah ini!&nbsp;</div><div>Bahasa adalah identitas bangsa. Itulah slogan yang selalu dielu-elukan setiap warga negara yang bangga terhadap bahasa nasional dan bahasa daerah yang dimilikinya. Seolah ia tak ingin jati dirinya diganggu orang lain atau pendatang asing. Pendatang asing justru harus menghormati identitas tersebut, baik dengan tidak merusak bahasa atau lebih baik lagi dengan ikut menggunakan bahasa tersebut walaupun terasa sulit.&nbsp;</div><div>Topik yang dibicarakan pada paragraf di atas adalah ...&nbsp;</div>', '#_#1_#_Bahasa identitas bangsa&nbsp;#_#2_#_Slogan warga negara terhadap bahasa&nbsp;#_#3_#_Jati diri bangsa ada pada bahasa&nbsp;#_#4_#_Pendatang asing mengganggu bahasa tuan rumah&nbsp;#_#5_#_Pendatang asing harus menghormati identitas sebuah bangsa&nbsp;#_#6_#_#_#', '1'),
(220, 90, '<div>Cermatilah pengalan cerita sejarah berikut untuk mengerjakan soal nomor 46 dan 47!&nbsp;</div><div>\"Juga Sang Adipati Tuban Arya Teja Tumenggung Wilwatikta tidak bebas dari ketentuan Maha Dewa. Sang Hyang Widhimerestui barang siapa punya kebenaran dalam hatinya. Jangan kuatir. Kepala desa! Kurang tepat jawabku kiranya? Ketakutan selalu jadi bagian mereka yang tak selalu berani mendirikan keadilan. Kejahatan selalu jadi bagian mereka yang tak berani yang mengingkari kebenaran mereka melanggar keadilan. Dua-duanya busuk, dua-duanya sumber keonaran di muka bumi ini….\" Dan ia teruskan wejangannya tentang kebenaran dan keadilan dan kedudukannya di tengah-tengah kehidupan manusia dan para dewa. (Pramudya Ananta Toer, Mangir, Jakarta, KPG,2000)&nbsp;</div><div>Nilai yang mendominasi dalam kutipan teks sejarah tersebut adalah…&nbsp;</div>', '#_#1_#_Agama#_#2_#_Moral&nbsp;#_#3_#_Pendidikan&nbsp;#_#4_#_Budaya&nbsp;#_#5_#_Estetika&nbsp;#_#6_#_#_#', '2'),
(221, 90, '<div><font color=\"#4a4a4a\" face=\"Times New Roman, serif\"><span style=\"font-size: 15.3333px;\">Cermatilah pengalan cerita sejarah berikut untuk mengerjakan soal nomor 46 dan 47!&nbsp;</span></font></div><div><font color=\"#4a4a4a\" face=\"Times New Roman, serif\"><span style=\"font-size: 15.3333px;\">\"Juga Sang Adipati Tuban Arya Teja Tumenggung Wilwatikta tidak bebas dari ketentuan Maha Dewa. Sang Hyang Widhimerestui barang siapa punya kebenaran dalam hatinya. Jangan kuatir. Kepala desa! Kurang tepat jawabku kiranya? Ketakutan selalu jadi bagian mereka yang tak selalu berani mendirikan keadilan. Kejahatan selalu jadi bagian mereka yang tak berani yang mengingkari kebenaran mereka melanggar keadilan. Dua-duanya busuk, dua-duanya sumber keonaran di muka bumi ini….\" Dan ia teruskan wejangannya tentang kebenaran dan keadilan dan kedudukannya di tengah-tengah kehidupan manusia dan para dewa. (Pramudya Ananta Toer, Mangir, Jakarta, KPG,2000)&nbsp;</span></font></div><div><div>Amanat dalam kutipan teks sejarah tersebut adalah…&nbsp;</div></div>', '#_#1_#_Perbuatan dosa dan dusta sama-sama akan melanggar keadilan.&nbsp;#_#2_#_Janganlah berbuat dusta karena akan menutup kesucian hati nurani.#_#3_#_Jangan takut membela kebenaran karena sama buruknya dengan kejahatan.&nbsp;#_#4_#_Segala amalan akan diperhitungkan di hari akhir sehingga senantiasa berbuat baik.&nbsp;#_#5_#_Seseorang yang memeliki kebenaran dalam hatinya akan selalu direstui Sang Kuasa.&nbsp;#_#6_#_#_#', '3'),
(222, 90, '<div>Cermatilah pengalan cerita sejarah berikut !&nbsp;</div><div>Di depan Ratu Biksunu Gayatri yang berdiri, Sri Gitarja duduk bersimpuh. Emban tua itu melanjutkan tugasnya, kali ini untuk Sekar Kedaton Dyah Wiyat yang terlihat lebih tegar dari kakaknya, atau boleh jadi merupakan penampakan dari sisi hatinya yang tidak bisa menerima dengan tulus pernikahan itu. Ketika para ibu Ratu menangis yang menulari siapapun untuk menangis, Dyah Wiyat sama sekali tidak menitihkan air mata. Manakala menatap segenap wajah yang hadi di ruangan itu, yang hadir dan melekat di benaknya justru wajah Rakrian Tanca. Ayunan tangan Gajah Mada yang menggenggam keris di dada keris di tangan prajurit tampan itu masih terbayang di kelopak matanya.&nbsp;</div><div>Sudut pandang penceritaan di atas adalah ....</div>', '#_#1_#_Orang ketiga tak sertaan&nbsp;#_#2_#_Orang tertama pelaku utama&nbsp;#_#3_#_Orang ketiga pelaku utama&nbsp;#_#4_#_Orang ketiga serba tahu#_#5_#_Orang pertama pelaku sampingan&nbsp;<br>#_#6_#_#_#', '4'),
(223, 90, '<div>Sulit sekali menemukan kekurangan pada buku ini. Semua unsur yang seharusnya dimiliki sebuah karya fiksi terpengaruh oleh buku ini. Bagi siswa yang tidak senang membaca karya sastra memang buku ini tidak menarik, sebab novel ini serius dan tidak cukup menarik.&nbsp;</div><div>Unsur yang dominan dalam penggalan resensi di atas adalah…….&nbsp;</div>', '#_#1_#_Kelemahan#_#2_#_Kelebihan&nbsp;#_#3_#_Kelemahan dan kelebihan#_#4_#_Novel tersebut tidak menarik bagi remaja#_#5_#_Novel tersebut tidak bersifat menghibur#_#6_#_#_#', '3'),
